 * @param alias
 * 		Must not be null nor empty
 * @throws MessagingException
 * 		Indicates an error in retrieving the certificate for the alias
 * 		(likely because the alias is invalid or the certificate was deleted)
 */
public KeyChainKeyManager(android.content.Context context, java.lang.String alias) throws com.fsck.k9.mail.MessagingException {
    mAlias = alias;
    try {
        mChain = fetchCertificateChain(context, alias);
        mPrivateKey = fetchPrivateKey(context, alias);
    } catch (android.security.KeyChainException e) {
        // The certificate was possibly deleted.  Notify user of error.
        throw new com.fsck.k9.mail.CertificateValidationException(e.getMessage(), com.fsck.k9.mail.CertificateValidationException.Reason.RetrievalFailure, alias);
    } catch (java.lang.InterruptedException e) {
        throw new com.fsck.k9.mail.CertificateValidationException(e.getMessage(), com.fsck.k9.mail.CertificateValidationException.Reason.RetrievalFailure, alias);
    }
}

