@java.lang.Override
public void handleAsyncUntaggedResponse(com.fsck.k9.mail.store.imap.ImapResponse response) {
    if (com.fsck.k9.mail.K9MailLib.isDebug()) {
        timber.log.Timber.v("Got async response: %s", response);
    }
    if (stop) {
        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
            timber.log.Timber.d("Got async untagged response: %s, but stop is set for %s", response, getLogId());
        }
        idleStopper.stopIdle();
    } else if (response.getTag() == null) {
        if (response.size() > 1) {
            java.lang.Object responseType = response.get(1);
            if ((com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(responseType, "EXISTS") || com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(responseType, "EXPUNGE")) || com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(responseType, "FETCH")) {
                wakeLock.acquire(com.fsck.k9.mail.K9MailLib.PUSH_WAKE_LOCK_TIMEOUT);
                if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                    timber.log.Timber.d("Got useful async untagged response: %s for %s", response, getLogId());
                }
                idleStopper.stopIdle();
            }
        } else if (response.isContinuationRequested()) {
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Idling %s", getLogId());
            }
            idleStopper.startAcceptingDoneContinuation(connection);
            wakeLock.release();
        }
    }
}

