private void login() throws com.fsck.k9.mail.MessagingException {
    executeSimpleCommand((com.fsck.k9.mail.store.pop3.Pop3Store.USER_COMMAND + " ") + mUsername);
    try {
        executeSimpleCommand((com.fsck.k9.mail.store.pop3.Pop3Store.PASS_COMMAND + " ") + mPassword, true);
    } catch (com.fsck.k9.mail.store.pop3.Pop3Store.Pop3ErrorResponse e) {
        throw new com.fsck.k9.mail.AuthenticationFailedException("POP3 login authentication failed: " + e.getMessage(), e);
    }
}

private java.lang.Object parseToken(com.fsck.k9.mail.store.imap.ImapList parent) throws java.io.IOException {
    while (true) {
        int ch = inputStream.peek();
        if (ch == '(') {
            return parseList(parent, '(', ')');
        } else if (ch == '[') {
            return parseList(parent, '[', ']');
        } else if (ch == ')') {
            expect(')');
            return ")";
        } else if (ch == ']') {
            expect(']');
            return "]";
        } else if (ch == '"') {
            return parseQuoted();
        } else if (ch == '{') {
            return parseLiteral();
        } else if (ch == ' ') {
            expect(' ');
        } else if (ch == '\r') {
            expect('\r');
            expect('\n');
            return null;
        } else if (ch == '\n') {
            expect('\n');
            return null;
        } else if (ch == '\t') {
            expect('\t');
        } else {
            return parseBareString(true);
        }
    } 
}

private com.fsck.k9.mail.MessagingException handleAuthenticationFailure(com.fsck.k9.mail.store.imap.NegativeImapResponseException e) {
    com.fsck.k9.mail.store.imap.ImapResponse lastResponse = e.getLastResponse();
    java.lang.String responseCode = com.fsck.k9.mail.store.imap.ResponseCodeExtractor.getResponseCode(lastResponse);
    // If there's no response code we simply assume it was an authentication failure.
    if ((responseCode == null) || responseCode.equals(com.fsck.k9.mail.store.imap.ResponseCodeExtractor.AUTHENTICATION_FAILED)) {
        if (e.wasByeResponseReceived()) {
            close();
        }
        return new com.fsck.k9.mail.AuthenticationFailedException(e.getMessage());
    } else {
        close();
        return e;
    }
}

public static java.lang.String getResponseCode(com.fsck.k9.mail.store.imap.ImapResponse response) {
    if ((response.size() < 2) || (!response.isList(1))) {
        return null;
    }
    com.fsck.k9.mail.store.imap.ImapList responseTextCode = response.getList(1);
    return responseTextCode.size() != 1 ? null : responseTextCode.getString(0);
}

private void retrievePathDelimiter() throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> listResponses;
    try {
        listResponses = executeSimpleCommand(com.fsck.k9.mail.store.imap.Commands.LIST + " \"\" \"\"");
    } catch (com.fsck.k9.mail.store.imap.NegativeImapResponseException e) {
        timber.log.Timber.d(e, "Error getting path delimiter using LIST command");
        return;
    }
    for (com.fsck.k9.mail.store.imap.ImapResponse response : listResponses) {
        if (isListResponse(response)) {
            java.lang.String hierarchyDelimiter = response.getString(2);
            settings.setPathDelimiter(hierarchyDelimiter);
            settings.setCombinedPrefix(null);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Got path delimiter '%s' for %s", settings.getPathDelimiter(), getLogId());
            }
            break;
        }
    }
}

private void completeCrLf() throws java.io.IOException {
    if (lastByte == com.fsck.k9.mail.filter.EOLConvertingOutputStream.CR) {
        writeByte(com.fsck.k9.mail.filter.EOLConvertingOutputStream.LF);
        // We have to ignore the next character if it is <LF>. Otherwise it
        // will be expanded to an additional <CR><LF> sequence although it
        // belongs to the one just completed.
        ignoreLf = true;
    }
}

