/**
 * Extracts buffered data into the provided byte[] array, starting
 * at position bPos, up to a maximum of bAvail bytes.  Returns how
 * many bytes were actually extracted.
 *
 * @param b
 * 		byte[] array to extract the buffered data into.
 * @param bPos
 * 		position in byte[] array to start extraction at.
 * @param bAvail
 * 		amount of bytes we're allowed to extract.  We may extract
 * 		fewer (if fewer are available).
 * @return The number of bytes successfully extracted into the provided
byte[] array.
 */
int readResults(byte[] b, int bPos, int bAvail) {
    if (buf != null) {
        int len = java.lang.Math.min(avail(), bAvail);
        if (buf != b) {
            java.lang.System.arraycopy(buf, readPos, b, bPos, len);
            readPos += len;
            if (readPos >= pos) {
                buf = null;
            }
        } else {
            // Re-using the original consumer's output array is only
            // allowed for one round.
            buf = null;
        }
        return len;
    } else {
        return eof ? -1 : 0;
    }
}

