private void indexUids(java.util.List<java.lang.String> uids) throws com.fsck.k9.mail.MessagingException, java.io.IOException {
    java.util.Set<java.lang.String> unindexedUids = new java.util.HashSet<java.lang.String>();
    for (java.lang.String uid : uids) {
        if (mUidToMsgMap.get(uid) == null) {
            if (com.fsck.k9.mail.K9MailLib.isDebug() && com.fsck.k9.mail.K9MailLib.DEBUG_PROTOCOL_POP3) {
                timber.log.Timber.d("Need to index UID %s", uid);
            }
            unindexedUids.add(uid);
        }
    }
    if (unindexedUids.isEmpty()) {
        return;
    }
    /* If we are missing uids in the cache the only sure way to
    get them is to do a full UIDL list. A possible optimization
    would be trying UIDL for the latest X messages and praying.
     */
    java.lang.String response = executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.UIDL_COMMAND);
    while ((response = readLine()) != null) {
        if (response.equals(".")) {
            break;
        }
        java.lang.String[] uidParts = response.split(" +");
        // Ignore messages without a unique-id
        if (uidParts.length >= 2) {
            java.lang.Integer msgNum = java.lang.Integer.valueOf(uidParts[0]);
            java.lang.String msgUid = uidParts[1];
            if (unindexedUids.contains(msgUid)) {
                if (com.fsck.k9.mail.K9MailLib.isDebug() && com.fsck.k9.mail.K9MailLib.DEBUG_PROTOCOL_POP3) {
                    timber.log.Timber.d("Got msgNum %d for UID %s", msgNum, msgUid);
                }
                com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message message = mUidToMsgMap.get(msgUid);
                if (message == null) {
                    message = new com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message(msgUid, this);
                }
                indexMessage(msgNum, message);
            }
        }
    } 
}

