/**
 * <p>
 * Consumer can use this constructor to choose a different lineLength
 * and lineSeparator when encoding.  All forms of data can
 * be decoded.
 * </p><p>
 * Note:  lineLengths that aren't multiples of 4 will still essentially
 * end up being multiples of 4 in the encoded data.
 * </p>
 *
 * @param lineLength
 * 		Each line of encoded data will be at most this long
 * 		(rounded up to nearest multiple of 4).  Ignored when decoding.
 * 		If <= 0, then output will not be divided into lines (chunks).
 * @param lineSeparator
 * 		Each line of encoded data will end with this
 * 		sequence of bytes.
 * 		If lineLength <= 0, then the lineSeparator is not used.
 * @throws IllegalArgumentException
 * 		The provided lineSeparator included
 * 		some base64 characters.  That's not going to work!
 */
public Base64(int lineLength, byte[] lineSeparator) {
    this.lineLength = lineLength;
    this.lineSeparator = new byte[lineSeparator.length];
    java.lang.System.arraycopy(lineSeparator, 0, this.lineSeparator, 0, lineSeparator.length);
    if (lineLength > 0) {
        this.encodeSize = 4 + lineSeparator.length;
    } else {
        this.encodeSize = 4;
    }
    this.decodeSize = encodeSize - 1;
    if (com.fsck.k9.mail.filter.Base64.containsBase64Byte(lineSeparator)) {
        java.lang.String sep = new java.lang.String(lineSeparator, java.nio.charset.Charset.forName("UTF-8"));
        throw new java.lang.IllegalArgumentException(("lineSeperator must not contain base64 characters: [" + sep) + "]");
    }
}

/**
 * Small optimization where we try to buffer directly to the consumer's
 * output array for one round (if consumer calls this method first!) instead
 * of starting our own buffer.
 *
 * @param out
 * 		byte[] array to buffer directly to.
 * @param outPos
 * 		Position to start buffering into.
 * @param outAvail
 * 		Amount of bytes available for direct buffering.
 */
void setInitialBuffer(byte[] out, int outPos, int outAvail) {
    // We can re-use consumer's original output array under
    // special circumstances, saving on some System.arraycopy().
    if ((out != null) && (out.length == outAvail)) {
        buf = out;
        pos = outPos;
        readPos = outPos;
    }
}

