private java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> authenticate() throws com.fsck.k9.mail.MessagingException, java.io.IOException {
    switch (settings.getAuthType()) {
        case XOAUTH2 :
            if (oauthTokenProvider == null) {
                throw new com.fsck.k9.mail.MessagingException("No OAuthToken Provider available.");
            } else if (hasCapability(com.fsck.k9.mail.store.imap.Capabilities.AUTH_XOAUTH2) && hasCapability(com.fsck.k9.mail.store.imap.Capabilities.SASL_IR)) {
                return authXoauth2withSASLIR();
            } else {
                throw new com.fsck.k9.mail.MessagingException("Server doesn't support SASL XOAUTH2.");
            }
        case CRAM_MD5 :
            {
                if (hasCapability(com.fsck.k9.mail.store.imap.Capabilities.AUTH_CRAM_MD5)) {
                    return authCramMD5();
                } else {
                    throw new com.fsck.k9.mail.MessagingException("Server doesn't support encrypted passwords using CRAM-MD5.");
                }
            }
        case PLAIN :
            {
                if (hasCapability(com.fsck.k9.mail.store.imap.Capabilities.AUTH_PLAIN)) {
                    return saslAuthPlainWithLoginFallback();
                } else if (!hasCapability(com.fsck.k9.mail.store.imap.Capabilities.LOGINDISABLED)) {
                    return login();
                } else {
                    throw new com.fsck.k9.mail.MessagingException("Server doesn't support unencrypted passwords using AUTH=PLAIN " + "and LOGIN is disabled.");
                }
            }
        case EXTERNAL :
            {
                if (hasCapability(com.fsck.k9.mail.store.imap.Capabilities.AUTH_EXTERNAL)) {
                    return saslAuthExternal();
                } else {
                    // Provide notification to user of a problem authenticating using client certificates
                    throw new com.fsck.k9.mail.CertificateValidationException(com.fsck.k9.mail.CertificateValidationException.Reason.MissingCapability);
                }
            }
        default :
            {
                throw new com.fsck.k9.mail.MessagingException("Unhandled authentication method found in the server settings (bug).");
            }
    }
}

