void autoconfigureFolders(final com.fsck.k9.mail.store.imap.ImapConnection connection) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    if (!connection.hasCapability(com.fsck.k9.mail.store.imap.Capabilities.SPECIAL_USE)) {
        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
            timber.log.Timber.d("No detected folder auto-configuration methods.");
        }
        return;
    }
    if (com.fsck.k9.mail.K9MailLib.isDebug()) {
        timber.log.Timber.d("Folder auto-configuration: Using RFC6154/SPECIAL-USE.");
    }
    java.lang.String command = java.lang.String.format("LIST (SPECIAL-USE) \"\" %s", com.fsck.k9.mail.store.imap.ImapUtility.encodeString(getCombinedPrefix() + "*"));
    java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = connection.executeSimpleCommand(command);
    java.util.List<com.fsck.k9.mail.store.imap.ListResponse> listResponses = com.fsck.k9.mail.store.imap.ListResponse.parseList(responses);
    for (com.fsck.k9.mail.store.imap.ListResponse listResponse : listResponses) {
        java.lang.String decodedFolderName;
        try {
            decodedFolderName = folderNameCodec.decode(listResponse.getName());
        } catch (java.nio.charset.CharacterCodingException e) {
            timber.log.Timber.w(e, "Folder name not correctly encoded with the UTF-7 variant as defined by RFC 3501: %s", listResponse.getName());
            // We currently just skip folders with malformed names.
            continue;
        }
        if (pathDelimiter == null) {
            pathDelimiter = listResponse.getHierarchyDelimiter();
            combinedPrefix = null;
        }
        if (listResponse.hasAttribute("\\Archive") || listResponse.hasAttribute("\\All")) {
            mStoreConfig.setArchiveFolderName(decodedFolderName);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Folder auto-configuration detected Archive folder: %s", decodedFolderName);
            }
        } else if (listResponse.hasAttribute("\\Drafts")) {
            mStoreConfig.setDraftsFolderName(decodedFolderName);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Folder auto-configuration detected Drafts folder: %s", decodedFolderName);
            }
        } else if (listResponse.hasAttribute("\\Sent")) {
            mStoreConfig.setSentFolderName(decodedFolderName);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Folder auto-configuration detected Sent folder: %s", decodedFolderName);
            }
        } else if (listResponse.hasAttribute("\\Junk")) {
            mStoreConfig.setSpamFolderName(decodedFolderName);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Folder auto-configuration detected Spam folder: %s", decodedFolderName);
            }
        } else if (listResponse.hasAttribute("\\Trash")) {
            mStoreConfig.setTrashFolderName(decodedFolderName);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Folder auto-configuration detected Trash folder: %s", decodedFolderName);
            }
        }
    }
}

