        throw new com.fsck.k9.mail.AuthenticationFailedException("POP3 APOP authentication failed: " + e.getMessage(), e);
    }
}

/**
 * <p>
 * Decodes all of the provided data, starting at inPos, for inAvail bytes.
 * Should be called at least twice:  once with the data to decode, and once
 * with inAvail set to "-1" to alert decoder that EOF has been reached.
 * The "-1" call is not necessary when decoding, but it doesn't hurt, either.
 * </p><p>
 * Ignores all non-base64 characters.  This is how chunked (e.g. 76 character)
 * data is handled, since CR and LF are silently ignored, but has implications
 * for other bytes, too.  This method subscribes to the garbage-in, garbage-out
 * philosophy:  it will not check the provided data for validity.
 * </p><p>
 * Thanks to "commons" project in ws.apache.org for the bitwise operations,
 * and general approach.
 * http://svn.apache.org/repos/asf/webservices/commons/trunk/modules/util/
 * </p>
 *
 * @param in
 * 		byte[] array of ascii data to base64 decode.
 * @param inPos
 * 		Position to start reading data from.
 * @param inAvail
 * 		Amount of bytes available from input for encoding.
 */
void decode(byte[] in, int inPos, int inAvail) {
    if (eof) {
        return;
    }
    if (inAvail < 0) {
        eof = true;
    }
    for (int i = 0; i < inAvail; i++) {
        if ((buf == null) || ((buf.length - pos) < decodeSize)) {
            resizeBuf();
        }
        byte b = in[inPos++];
        if (b == com.fsck.k9.mail.filter.Base64.PAD) {
            x = x << 6;
            switch (modulus) {
                case 2 :
                    x = x << 6;
                    buf[pos++] = ((byte) ((x >> 16) & com.fsck.k9.mail.filter.Base64.MASK_8BITS));
                    break;
                case 3 :
                    buf[pos++] = ((byte) ((x >> 16) & com.fsck.k9.mail.filter.Base64.MASK_8BITS));
                    buf[pos++] = ((byte) ((x >> 8) & com.fsck.k9.mail.filter.Base64.MASK_8BITS));
                    break;
            }
            // WE'RE DONE!!!!
            eof = true;
            return;
        } else if ((b >= 0) && (b < com.fsck.k9.mail.filter.Base64.base64ToInt.length)) {
            int result = com.fsck.k9.mail.filter.Base64.base64ToInt[b];
            if (result >= 0) {
                modulus = (++modulus) % 4;
                x = (x << 6) + result;
                if (modulus == 0) {
                    buf[pos++] = ((byte) ((x >> 16) & com.fsck.k9.mail.filter.Base64.MASK_8BITS));
                    buf[pos++] = ((byte) ((x >> 8) & com.fsck.k9.mail.filter.Base64.MASK_8BITS));
                    buf[pos++] = ((byte) (x & com.fsck.k9.mail.filter.Base64.MASK_8BITS));
                }
            }
        }
    }
}

