private void fetchEnvelope(java.util.List<com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message> messages, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message> listener) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    int unsizedMessages = 0;
    for (com.fsck.k9.mail.Message message : messages) {
        if (message.getSize() == (-1)) {
            unsizedMessages++;
        }
    }
    if (unsizedMessages == 0) {
        return;
    }
    if ((unsizedMessages < 50) && (mMessageCount > 5000)) {
        /* In extreme cases we'll do a command per message instead of a bulk request
        to hopefully save some time and bandwidth.
         */
        for (int i = 0, count = messages.size(); i < count; i++) {
            com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message message = messages.get(i);
            if (listener != null) {
                listener.messageStarted(message.getUid(), i, count);
            }
            java.lang.String response = executeSimpleCommand(java.lang.String.format(java.util.Locale.US, com.fsck.k9.mail.store.pop3.Pop3Store.LIST_COMMAND + " %d", mUidToMsgNumMap.get(message.getUid())));
            java.lang.String[] listParts = response.split(" ");
            // int msgNum = Integer.parseInt(listParts[1]);
            int msgSize = java.lang.Integer.parseInt(listParts[2]);
            message.setSize(msgSize);
            if (listener != null) {
                listener.messageFinished(message, i, count);
            }
        }
    } else {
        java.util.Set<java.lang.String> msgUidIndex = new java.util.HashSet<java.lang.String>();
        for (com.fsck.k9.mail.Message message : messages) {
            msgUidIndex.add(message.getUid());
        }
        int i = 0;
        int count = messages.size();
        java.lang.String response = executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.LIST_COMMAND);
        while ((response = readLine()) != null) {
            if (response.equals(".")) {
                break;
            }
            java.lang.String[] listParts = response.split(" ");
            int msgNum = java.lang.Integer.parseInt(listParts[0]);
            int msgSize = java.lang.Integer.parseInt(listParts[1]);
            com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message pop3Message = mMsgNumToMsgMap.get(msgNum);
            if ((pop3Message != null) && msgUidIndex.contains(pop3Message.getUid())) {
                if (listener != null) {
                    listener.messageStarted(pop3Message.getUid(), i, count);
                }
                pop3Message.setSize(msgSize);
                if (listener != null) {
                    listener.messageFinished(pop3Message, i, count);
                }
                i++;
            }
        } 
    }
}

