protected java.io.InputStream sendRequest(java.lang.String url, java.lang.String method, org.apache.http.entity.StringEntity messageBody, java.util.Map<java.lang.String, java.lang.String> headers, boolean tryAuth) throws com.fsck.k9.mail.MessagingException {
    if ((url == null) || (method == null)) {
        return null;
    }
    com.fsck.k9.mail.store.webdav.WebDavHttpClient httpClient = getHttpClient();
    try {
        int statusCode;
        com.fsck.k9.mail.store.webdav.HttpGeneric httpMethod = new com.fsck.k9.mail.store.webdav.HttpGeneric(url);
        org.apache.http.HttpResponse response;
        org.apache.http.HttpEntity entity;
        if (messageBody != null) {
            httpMethod.setEntity(messageBody);
        }
        if (headers != null) {
            for (java.util.Map.Entry<java.lang.String, java.lang.String> entry : headers.entrySet()) {
                httpMethod.setHeader(entry.getKey(), entry.getValue());
            }
        }
        if (authenticationType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_NONE) {
            if ((!tryAuth) || (!authenticate())) {
                throw new com.fsck.k9.mail.MessagingException("Unable to authenticate in sendRequest().");
            }
        } else if (authenticationType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_BASIC) {
            httpMethod.setHeader("Authorization", authString);
        }
        httpMethod.setMethod(method);
        response = httpClient.executeOverride(httpMethod, httpContext);
        statusCode = response.getStatusLine().getStatusCode();
        entity = response.getEntity();
        if (statusCode == 401) {
            throw new com.fsck.k9.mail.MessagingException("Invalid username or password for Basic authentication.");
        } else if (statusCode == 440) {
            if (tryAuth && (authenticationType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_FORM_BASED)) {
                // Our cookie expired, re-authenticate.
                performFormBasedAuthentication(null);
                sendRequest(url, method, messageBody, headers, false);
            } else {
                throw new com.fsck.k9.mail.MessagingException("Authentication failure in sendRequest().");
            }
        } else if (statusCode == 302) {
            handleUnexpectedRedirect(response, url);
        } else if ((statusCode < 200) || (statusCode >= 300)) {
            throw new java.io.IOException((("Error with code " + statusCode) + " during request processing: ") + response.getStatusLine().toString());
        }
        if (entity != null) {
            return com.fsck.k9.mail.store.webdav.WebDavHttpClient.getUngzippedContent(entity);
        }
    } catch (java.io.UnsupportedEncodingException uee) {
        timber.log.Timber.e(uee, "UnsupportedEncodingException: ");
        throw new com.fsck.k9.mail.MessagingException("UnsupportedEncodingException", uee);
    } catch (java.io.IOException ioe) {
        timber.log.Timber.e(ioe, "IOException: ");
        throw new com.fsck.k9.mail.MessagingException("IOException", ioe);
    }
    return null;
}

