private com.fsck.k9.mail.transport.smtp.SmtpTransport.CommandResponse executeCommand(boolean sensitive, java.lang.String format, java.lang.Object... args) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    java.util.List<java.lang.String> results = new java.util.ArrayList<>();
    if (format != null) {
        java.lang.String command = java.lang.String.format(java.util.Locale.ROOT, format, args);
        writeLine(command, sensitive);
    }
    java.lang.String line = readCommandResponseLine(results);
    int length = line.length();
    if (length < 1) {
        throw new com.fsck.k9.mail.MessagingException("SMTP response is 0 length");
    }
    int replyCode = -1;
    if (length >= 3) {
        try {
            replyCode = java.lang.Integer.parseInt(line.substring(0, 3));
        } catch (java.lang.NumberFormatException e) {
            /* ignore */
        }
    }
    char replyCodeCategory = line.charAt(0);
    boolean isReplyCodeErrorCategory = (replyCodeCategory == '4') || (replyCodeCategory == '5');
    if (isReplyCodeErrorCategory) {
        if (isEnhancedStatusCodesProvided) {
            throw buildEnhancedNegativeSmtpReplyException(replyCode, results);
        } else {
            java.lang.String replyText = android.text.TextUtils.join(" ", results);
            throw new com.fsck.k9.mail.transport.smtp.NegativeSmtpReplyException(replyCode, replyText);
        }
    }
    return new com.fsck.k9.mail.transport.smtp.SmtpTransport.CommandResponse(replyCode, results);
}

