/**
 * Decodes a string containing encoded words as defined by RFC 2047.
 * Encoded words in have the form
 * =?charset?enc?Encoded word?= where enc is either 'Q' or 'q' for
 * quoted-printable and 'B' or 'b' for Base64.
 *
 * ANDROID:  COPIED FROM A NEWER VERSION OF MIME4J
 *
 * @param body
 * 		the string to decode.
 * @param message
 * 		the message which has the string.
 * @return the decoded string.
 */
public static java.lang.String decodeEncodedWords(java.lang.String body, com.fsck.k9.mail.Message message) {
    // ANDROID:  Most strings will not include "=?" so a quick test can prevent unneeded
    // object creation.  This could also be handled via lazy creation of the StringBuilder.
    if (!body.contains("=?")) {
        return body;
    }
    int previousEnd = 0;
    boolean previousWasEncoded = false;
    java.lang.StringBuilder sb = new java.lang.StringBuilder();
    while (true) {
        int begin = body.indexOf("=?", previousEnd);
        if (begin == (-1)) {
            sb.append(body.substring(previousEnd));
            return sb.toString();
        }
        // ANDROID:  The mime4j original version has an error here.  It gets confused if
        // the encoded string begins with an '=' (just after "?Q?").  This patch seeks forward
        // to find the two '?' in the "header", before looking for the final "?=".
        int qm1 = body.indexOf('?', begin + 2);
        if (qm1 == (-1)) {
            sb.append(body.substring(previousEnd));
            return sb.toString();
        }
        int qm2 = body.indexOf('?', qm1 + 1);
        if (qm2 == (-1)) {
            sb.append(body.substring(previousEnd));
            return sb.toString();
        }
        int end = body.indexOf("?=", qm2 + 1);
        if (end == (-1)) {
            sb.append(body.substring(previousEnd));
            return sb.toString();
        }
        end += 2;
        java.lang.String sep = body.substring(previousEnd, begin);
        java.lang.String decoded = com.fsck.k9.mail.internet.DecoderUtil.decodeEncodedWord(body, begin, end, message);
        if (decoded == null) {
            sb.append(sep);
            sb.append(body.substring(begin, end));
        } else {
            if ((!previousWasEncoded) || (!org.apache.james.mime4j.util.CharsetUtil.isWhitespace(sep))) {
                sb.append(sep);
            }
            sb.append(decoded);
        }
        previousEnd = end;
        previousWasEncoded = decoded != null;
    } 
}

