private static int qEncodedLength(byte[] bytes) {
    int count = 0;
    for (byte b : bytes) {
        int v = b & 0xff;
        if (v == 32) {
            count++;
        } else if (!com.fsck.k9.mail.internet.EncoderUtil.Q_RESTRICTED_CHARS.get(v)) {
            count += 3;
        } else {
            count++;
        }
    }
    return count;
}

