        if (this.connection == null) {
            connection = store.getConnection();
        } else {
            connection = this.connection;
        }
    }
    try {
        java.lang.String encodedFolderName = folderNameCodec.encode(getPrefixedName());
        java.lang.String escapedFolderName = com.fsck.k9.mail.store.imap.ImapUtility.encodeString(encodedFolderName);
        connection.executeSimpleCommand(java.lang.String.format("CREATE %s", escapedFolderName));
        return true;
    } catch (com.fsck.k9.mail.store.imap.NegativeImapResponseException e) {
        return false;
    } catch (java.io.IOException ioe) {
        throw ioExceptionHandler(this.connection, ioe);
    } finally {
        if (this.connection == null) {
            store.releaseConnection(connection);
        }
    }
