public void endMultipart() {
    expect(com.fsck.k9.mail.Multipart.class);
    com.fsck.k9.mail.Multipart multipart = ((com.fsck.k9.mail.Multipart) (stack.removeFirst()));
    boolean hasNoBodyParts = multipart.getCount() == 0;
