public java.util.List<? extends com.fsck.k9.mail.Folder> getPersonalNamespaces(boolean forceListAll) throws com.fsck.k9.mail.MessagingException {
    java.util.List<com.fsck.k9.mail.Folder> folderList = new java.util.LinkedList<>();
    /* We have to check authentication here so we have the proper URL stored */
    getHttpClient();
    /* Firstly we get the "special" folders list (inbox, outbox, etc)
    and setup the account accordingly
     */
    java.util.Map<java.lang.String, java.lang.String> headers = new java.util.HashMap<>();
    headers.put("Depth", "0");
    headers.put("Brief", "t");
    com.fsck.k9.mail.store.webdav.DataSet dataset = processRequest(this.baseUrl, "PROPFIND", getSpecialFoldersList(), headers);
    java.util.Map<java.lang.String, java.lang.String> specialFoldersMap = dataset.getSpecialFolderToUrl();
    java.lang.String folderName = getFolderName(specialFoldersMap.get(com.fsck.k9.mail.store.webdav.WebDavConstants.DAV_MAIL_INBOX_FOLDER));
    if (folderName != null) {
        mStoreConfig.setAutoExpandFolderName(folderName);
        mStoreConfig.setInboxFolderName(folderName);
    }
    folderName = getFolderName(specialFoldersMap.get(com.fsck.k9.mail.store.webdav.WebDavConstants.DAV_MAIL_DRAFTS_FOLDER));
    if (folderName != null) {
        mStoreConfig.setDraftsFolderName(folderName);
    }
    folderName = getFolderName(specialFoldersMap.get(com.fsck.k9.mail.store.webdav.WebDavConstants.DAV_MAIL_TRASH_FOLDER));
    if (folderName != null) {
        mStoreConfig.setTrashFolderName(folderName);
    }
    folderName = getFolderName(specialFoldersMap.get(com.fsck.k9.mail.store.webdav.WebDavConstants.DAV_MAIL_SPAM_FOLDER));
    if (folderName != null) {
        mStoreConfig.setSpamFolderName(folderName);
    }
    // K-9 Mail's outbox is a special local folder and different from Exchange/WebDAV's outbox.
    /* folderName = getFolderName(specialFoldersMap.get(DAV_MAIL_OUTBOX_FOLDER));
    if (folderName != null)
    mAccount.setOutboxFolderName(folderName);
     */
    folderName = getFolderName(specialFoldersMap.get(com.fsck.k9.mail.store.webdav.WebDavConstants.DAV_MAIL_SENT_FOLDER));
    if (folderName != null) {
        mStoreConfig.setSentFolderName(folderName);
    }
    /* Next we get all the folders (including "special" ones) */
    headers = new java.util.HashMap<>();
    headers.put("Brief", "t");
    dataset = processRequest(this.baseUrl, "SEARCH", getFolderListXml(), headers);
    java.lang.String[] folderUrls = dataset.getHrefs();
    for (java.lang.String tempUrl : folderUrls) {
        com.fsck.k9.mail.store.webdav.WebDavFolder folder = createFolder(tempUrl);
        if (folder != null) {
            folderList.add(folder);
        }
    }
    return folderList;
}

