public java.lang.String getUidFromMessageId(com.fsck.k9.mail.Message message) throws com.fsck.k9.mail.MessagingException {
    try {
        /* Try to find the UID of the message we just appended using the
        Message-ID header.
         */
        java.lang.String[] messageIdHeader = message.getHeader("Message-ID");
        if (messageIdHeader.length == 0) {
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Did not get a message-id in order to search for UID  for %s", getLogId());
            }
            return null;
        }
        java.lang.String messageId = messageIdHeader[0];
        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
            timber.log.Timber.d("Looking for UID for message with message-id %s for %s", messageId, getLogId());
        }
        java.lang.String command = java.lang.String.format("UID SEARCH HEADER MESSAGE-ID %s", com.fsck.k9.mail.store.imap.ImapUtility.encodeString(messageId));
        java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = executeSimpleCommand(command);
        for (com.fsck.k9.mail.store.imap.ImapResponse response : responses) {
            if (((response.getTag() == null) && com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(0), "SEARCH")) && (response.size() > 1)) {
                return response.getString(1);
            }
        }
        return null;
    } catch (java.io.IOException ioe) {
        throw new com.fsck.k9.mail.MessagingException("Could not find UID for message based on Message-ID", ioe);
    }
}

