/**
 * Send the client "identity" using the EHLO or HELO command.
 *
 * <p>
 * We first try the EHLO command. If the server sends a negative response, it probably doesn't
 * support the EHLO command. So we try the older HELO command that all servers need to support.
 * And if that fails, too, we pretend everything is fine and continue unimpressed.
 * </p>
 *
 * @param host
 * 		The EHLO/HELO parameter as defined by the RFC.
 * @return A (possibly empty) {@code Map<String,String>} of extensions (upper case) and
their parameters (possibly 0 length) as returned by the EHLO command
 * @throws IOException
 * 		In case of a network error.
 * @throws MessagingException
 * 		In case of a malformed response.
 */
private java.util.Map<java.lang.String, java.lang.String> sendHello(java.lang.String host) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    java.util.Map<java.lang.String, java.lang.String> extensions = new java.util.HashMap<>();
    try {
        java.util.List<java.lang.String> results = executeCommand("EHLO %s", host).results;
        // Remove the EHLO greeting response
        results.remove(0);
        for (java.lang.String result : results) {
            java.lang.String[] pair = result.split(" ", 2);
            extensions.put(pair[0].toUpperCase(java.util.Locale.US), pair.length == 1 ? "" : pair[1]);
        }
    } catch (com.fsck.k9.mail.transport.smtp.NegativeSmtpReplyException e) {
        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
            timber.log.Timber.v("Server doesn't support the EHLO command. Trying HELO...");
        }
        try {
            executeCommand("HELO %s", host);
        } catch (com.fsck.k9.mail.transport.smtp.NegativeSmtpReplyException e2) {
            timber.log.Timber.w("Server doesn't support the HELO command. Continuing anyway.");
        }
    }
    return extensions;
}

