private void parseBodyStructure(com.fsck.k9.mail.store.imap.ImapList bs, com.fsck.k9.mail.Part part, java.lang.String id) throws com.fsck.k9.mail.MessagingException {
    if (bs.get(0) instanceof com.fsck.k9.mail.store.imap.ImapList) {
        /* This is a multipart/* */
        com.fsck.k9.mail.internet.MimeMultipart mp = com.fsck.k9.mail.internet.MimeMultipart.newInstance();
        for (int i = 0, count = bs.size(); i < count; i++) {
            if (bs.get(i) instanceof com.fsck.k9.mail.store.imap.ImapList) {
                /* For each part in the message we're going to add a new BodyPart and parse
                into it.
                 */
                com.fsck.k9.mail.internet.MimeBodyPart bp = new com.fsck.k9.mail.internet.MimeBodyPart();
                if (id.equalsIgnoreCase("TEXT")) {
                    parseBodyStructure(bs.getList(i), bp, java.lang.Integer.toString(i + 1));
                } else {
                    parseBodyStructure(bs.getList(i), bp, (id + ".") + (i + 1));
                }
                mp.addBodyPart(bp);
            } else {
                /* We've got to the end of the children of the part, so now we can find out
                what type it is and bail out.
                 */
                java.lang.String subType = bs.getString(i);
                mp.setSubType(subType.toLowerCase(java.util.Locale.US));
                break;
            }
        }
        com.fsck.k9.mail.internet.MimeMessageHelper.setBody(part, mp);
    } else {
        /* This is a body. We need to add as much information as we can find out about
        it to the Part.
         */
        /* 0| 0  body type
        1| 1  body subtype
        2| 2  body parameter parenthesized list
        3| 3  body id (unused)
        4| 4  body description (unused)
        5| 5  body encoding
        6| 6  body size
        -| 7  text lines (only for type TEXT, unused)
        Extensions (optional):
        7| 8  body MD5 (unused)
        8| 9  body disposition
        9|10  body language (unused)
        10|11  body location (unused)
         */
        java.lang.String type = bs.getString(0);
        java.lang.String subType = bs.getString(1);
        java.lang.String mimeType = ((type + "/") + subType).toLowerCase(java.util.Locale.US);
        com.fsck.k9.mail.store.imap.ImapList bodyParams = null;
        if (bs.get(2) instanceof com.fsck.k9.mail.store.imap.ImapList) {
            bodyParams = bs.getList(2);
        }
        java.lang.String encoding = bs.getString(5);
        int size = bs.getNumber(6);
        if (com.fsck.k9.mail.internet.MimeUtility.isMessage(mimeType)) {
            // A body type of type MESSAGE and subtype RFC822
            // contains, immediately after the basic fields, the
            // envelope structure, body structure, and size in
            // text lines of the encapsulated message.
            // [MESSAGE, RFC822, [NAME, Fwd: [#HTR-517941]:  update plans at 1am Friday - Memory allocation - displayware.eml], NIL, NIL, 7BIT, 5974, NIL, [INLINE, [FILENAME*0, Fwd: [#HTR-517941]:  update plans at 1am Friday - Memory all, FILENAME*1, ocation - displayware.eml]], NIL]
            /* This will be caught by fetch and handled appropriately. */
            throw new com.fsck.k9.mail.MessagingException("BODYSTRUCTURE message/rfc822 not yet supported.");
        }
        /* Set the content type with as much information as we know right now. */
        java.lang.StringBuilder contentType = new java.lang.StringBuilder();
        contentType.append(mimeType);
        if (bodyParams != null) {
            /* If there are body params we might be able to get some more information out
            of them.
             */
