private static java.lang.String getTextFromTextPart(com.fsck.k9.mail.Part part, com.fsck.k9.mail.Body body, java.lang.String mimeType, long textSizeLimit) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    /* We've got a text part, so let's see if it needs to be processed further. */
    java.lang.String charset = com.fsck.k9.mail.internet.MimeUtility.getHeaderParameter(part.getContentType(), "charset");
    /* determine the charset from HTML message. */
    if (com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(mimeType, "text/html") && (charset == null)) {
        java.io.InputStream in = com.fsck.k9.mail.internet.MimeUtility.decodeBody(body);
        try {
            byte[] buf = new byte[256];
            in.read(buf, 0, buf.length);
            java.lang.String str = new java.lang.String(buf, "US-ASCII");
            if (str.isEmpty()) {
                return "";
            }
            java.util.regex.Pattern p = java.util.regex.Pattern.compile("<meta http-equiv=\"?Content-Type\"? content=\"text/html; charset=(.+?)\">", java.util.regex.Pattern.CASE_INSENSITIVE);
            java.util.regex.Matcher m = p.matcher(str);
            if (m.find()) {
                charset = m.group(1);
            }
        } finally {
            try {
                com.fsck.k9.mail.internet.MimeUtility.closeInputStreamWithoutDeletingTemporaryFiles(in);
            } catch (java.io.IOException e) {
                /* ignore */
            }
        }
    }
    charset = com.fsck.k9.mail.internet.CharsetSupport.fixupCharset(charset, com.fsck.k9.mail.internet.MessageExtractor.getMessageFromPart(part));
    /* Now we read the part into a buffer for further processing. Because
    the stream is now wrapped we'll remove any transfer encoding at this point.
     */
    java.io.InputStream in = com.fsck.k9.mail.internet.MimeUtility.decodeBody(body);
    java.io.InputStream possiblyLimitedIn = (textSizeLimit != com.fsck.k9.mail.internet.MessageExtractor.NO_TEXT_SIZE_LIMIT) ? new org.apache.commons.io.input.BoundedInputStream(in, textSizeLimit) : in;
    try {
        return com.fsck.k9.mail.internet.CharsetSupport.readToString(possiblyLimitedIn, charset);
    } finally {
        try {
            com.fsck.k9.mail.internet.MimeUtility.closeInputStreamWithoutDeletingTemporaryFiles(in);
        } catch (java.io.IOException e) {
            /* Ignore */
        }
    }
}

