public java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> getMessages(int start, int end, java.util.Date earliestDate, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.webdav.WebDavMessage> listener) throws com.fsck.k9.mail.MessagingException {
    java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> messages = new java.util.ArrayList<com.fsck.k9.mail.store.webdav.WebDavMessage>();
    java.lang.String[] uids;
    java.util.Map<java.lang.String, java.lang.String> headers = new java.util.HashMap<java.lang.String, java.lang.String>();
    int uidsLength;
    java.lang.String messageBody;
    int prevStart = start;
    /**
     * Reverse the message range since 0 index is newest
     */
    start = this.mMessageCount - end;
    end = start + (end - prevStart);
    if (((start < 0) || (end < 0)) || (end < start)) {
        throw new com.fsck.k9.mail.MessagingException(java.lang.String.format(java.util.Locale.US, "Invalid message set %d %d", start, end));
    }
    if ((start == 0) && (end < 10)) {
        end = 10;
    }
    /**
     * Verify authentication
     */
    messageBody = store.getMessagesXml();
    headers.put("Brief", "t");
    headers.put("Range", (("rows=" + start) + "-") + end);
    com.fsck.k9.mail.store.webdav.DataSet dataset = store.processRequest(this.mFolderUrl, "SEARCH", messageBody, headers);
    uids = dataset.getUids();
    java.util.Map<java.lang.String, java.lang.String> uidToUrl = dataset.getUidToUrl();
    uidsLength = uids.length;
    for (int i = 0; i < uidsLength; i++) {
        if (listener != null) {
            listener.messageStarted(uids[i], i, uidsLength);
        }
        com.fsck.k9.mail.store.webdav.WebDavMessage message = new com.fsck.k9.mail.store.webdav.WebDavMessage(uids[i], this);
        message.setUrl(uidToUrl.get(uids[i]));
        messages.add(message);
        if (listener != null) {
            listener.messageFinished(message, i, uidsLength);
        }
    }
    return messages;
}

