/**
 * Decodes a WebDavStore URI.
 * <p/>
 * <p>Possible forms:</p>
 * <pre>
 * webdav://user:password@server:port ConnectionSecurity.NONE
 * webdav+ssl+://user:password@server:port ConnectionSecurity.SSL_TLS_REQUIRED
 * </pre>
 */
public static com.fsck.k9.mail.store.webdav.WebDavStoreSettings decode(java.lang.String uri) {
    java.lang.String host;
    int port;
    com.fsck.k9.mail.ConnectionSecurity connectionSecurity;
    java.lang.String username = null;
    java.lang.String password = null;
    java.lang.String alias = null;
    java.lang.String path = null;
    java.lang.String authPath = null;
    java.lang.String mailboxPath = null;
    java.net.URI webDavUri;
    try {
        webDavUri = new java.net.URI(uri);
    } catch (java.net.URISyntaxException use) {
        throw new java.lang.IllegalArgumentException("Invalid WebDavStore URI", use);
    }
    java.lang.String scheme = webDavUri.getScheme();
    /* Currently available schemes are:
    webdav
    webdav+ssl+

    The following are obsolete schemes that may be found in pre-existing
    settings from earlier versions or that may be found when imported. We
    continue to recognize them and re-map them appropriately:
    webdav+tls
    webdav+tls+
    webdav+ssl
     */
    if (scheme.equals("webdav")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.NONE;
    } else if (scheme.startsWith("webdav+")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.SSL_TLS_REQUIRED;
    } else {
        throw new java.lang.IllegalArgumentException(("Unsupported protocol (" + scheme) + ")");
    }
    host = webDavUri.getHost();
    if (host.startsWith("http")) {
        java.lang.String[] hostParts = host.split("://", 2);
        if (hostParts.length > 1) {
            host = hostParts[1];
        }
    }
    port = webDavUri.getPort();
    java.lang.String userInfo = webDavUri.getUserInfo();
    if (userInfo != null) {
        java.lang.String[] userInfoParts = userInfo.split(":");
        username = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[0]);
        java.lang.String userParts[] = username.split("\\\\", 2);
        if (userParts.length > 1) {
            alias = userParts[1];
        } else {
            alias = username;
        }
        if (userInfoParts.length > 1) {
            password = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[1]);
        }
    }
    java.lang.String[] pathParts = webDavUri.getPath().split("\\|");
    for (int i = 0, count = pathParts.length; i < count; i++) {
        if (i == 0) {
            if ((pathParts[0] != null) && (pathParts[0].length() > 1)) {
                path = pathParts[0];
            }
        } else if (i == 1) {
            if ((pathParts[1] != null) && (pathParts[1].length() > 1)) {
                authPath = pathParts[1];
            }
        } else if (i == 2) {
            if ((pathParts[2] != null) && (pathParts[2].length() > 1)) {
                mailboxPath = pathParts[2];
            }
        }
    }
    return new com.fsck.k9.mail.store.webdav.WebDavStoreSettings(host, port, connectionSecurity, null, username, password, null, alias, path, authPath, mailboxPath);
}

