/**
 * Ensures that the given message set (from start to end inclusive)
 * has been queried so that uids are available in the local cache.
 *
 * @param start
 * @param end
 * @throws MessagingException
 * @throws IOException
 */
private void indexMsgNums(int start, int end) throws com.fsck.k9.mail.MessagingException, java.io.IOException {
    int unindexedMessageCount = 0;
    for (int msgNum = start; msgNum <= end; msgNum++) {
        if (mMsgNumToMsgMap.get(msgNum) == null) {
            unindexedMessageCount++;
        }
    }
    if (unindexedMessageCount == 0) {
        return;
    }
    if ((unindexedMessageCount < 50) && (mMessageCount > 5000)) {
        /* In extreme cases we'll do a UIDL command per message instead of a bulk
        download.
         */
        for (int msgNum = start; msgNum <= end; msgNum++) {
            com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message message = mMsgNumToMsgMap.get(msgNum);
            if (message == null) {
                java.lang.String response = executeSimpleCommand((com.fsck.k9.mail.store.pop3.Pop3Store.UIDL_COMMAND + " ") + msgNum);
                // response = "+OK msgNum msgUid"
                java.lang.String[] uidParts = response.split(" +");
                if ((uidParts.length < 3) || (!"+OK".equals(uidParts[0]))) {
                    timber.log.Timber.e("ERR response: %s", response);
                    return;
                }
                java.lang.String msgUid = uidParts[2];
                message = new com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message(msgUid, this);
                indexMessage(msgNum, message);
            }
        }
    } else {
        java.lang.String response = executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.UIDL_COMMAND);
        while ((response = readLine()) != null) {
            if (response.equals(".")) {
                break;
            }
            /* Yet another work-around for buggy server software:
            split the response into message number and unique identifier, no matter how many spaces it has

            Example for a malformed response:
            1   2011071307115510400ae3e9e00bmu9

            Note the three spaces between message number and unique identifier.
            See issue 3546
             */
            java.lang.String[] uidParts = response.split(" +");
            if ((uidParts.length >= 3) && "+OK".equals(uidParts[0])) {
                /* At least one server software places a "+OK" in
                front of every line in the unique-id listing.

                Fix up the array if we detected this behavior.
                See Issue 1237
                 */
                uidParts[0] = uidParts[1];
                uidParts[1] = uidParts[2];
            }
            if (uidParts.length >= 2) {
                java.lang.Integer msgNum = java.lang.Integer.valueOf(uidParts[0]);
                java.lang.String msgUid = uidParts[1];
                if ((msgNum >= start) && (msgNum <= end)) {
                    com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message message = mMsgNumToMsgMap.get(msgNum);
                    if (message == null) {
                        message = new com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message(msgUid, this);
                        indexMessage(msgNum, message);
                    }
                }
            }
        } 
    }
}

