public static com.fsck.k9.mail.store.imap.PermanentFlagsResponse parse(com.fsck.k9.mail.store.imap.ImapResponse response) {
    if ((response.isTagged() || (!com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(0), com.fsck.k9.mail.store.imap.Responses.OK))) || (!response.isList(1))) {
        return null;
    }
    com.fsck.k9.mail.store.imap.ImapList responseTextList = response.getList(1);
    if (((responseTextList.size() < 2) || (!com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(responseTextList.get(0), com.fsck.k9.mail.store.imap.Responses.PERMANENTFLAGS))) || (!responseTextList.isList(1))) {
        return null;
    }
    com.fsck.k9.mail.store.imap.ImapList permanentFlagsList = responseTextList.getList(1);
    int size = permanentFlagsList.size();
    java.util.Set<com.fsck.k9.mail.Flag> flags = new java.util.HashSet<>(size);
    boolean canCreateKeywords = false;
    for (int i = 0; i < size; i++) {
        if (!permanentFlagsList.isString(i)) {
            return null;
        }
        java.lang.String flag = permanentFlagsList.getString(i);
        java.lang.String compareFlag = flag.toLowerCase(java.util.Locale.US);
        switch (compareFlag) {
            case "\\deleted" :
                {
                    flags.add(com.fsck.k9.mail.Flag.DELETED);
                    break;
                }
            case "\\answered" :
                {
                    flags.add(com.fsck.k9.mail.Flag.ANSWERED);
                    break;
                }
            case "\\seen" :
                {
                    flags.add(com.fsck.k9.mail.Flag.SEEN);
                    break;
                }
            case "\\flagged" :
                {
                    flags.add(com.fsck.k9.mail.Flag.FLAGGED);
                    break;
                }
            case "$forwarded" :
                {
                    flags.add(com.fsck.k9.mail.Flag.FORWARDED);
                    break;
                }
            case "\\*" :
                {
                    canCreateKeywords = true;
                    break;
                }
        }
    }
    return new com.fsck.k9.mail.store.imap.PermanentFlagsResponse(flags, canCreateKeywords);
}

