/**
 * Returns the named parameter of a header field. If name is null the first
 * parameter is returned, or if there are no additional parameters in the
 * field the entire field is returned. Otherwise the named parameter is
 * searched for in a case insensitive fashion and returned.
 *
 * @param headerValue
 * 		the header value
 * @param parameterName
 * 		the parameter name
 * @return the value. if the parameter cannot be found the method returns null.
 */
public static java.lang.String getHeaderParameter(java.lang.String headerValue, java.lang.String parameterName) {
    if (headerValue == null) {
        return null;
    }
    headerValue = headerValue.replaceAll("\r|\n", "");
    java.lang.String[] parts = headerValue.split(";");
    if ((parameterName == null) && (parts.length > 0)) {
        return parts[0].trim();
    }
    for (java.lang.String part : parts) {
        if ((parameterName != null) && part.trim().toLowerCase(java.util.Locale.US).startsWith(parameterName.toLowerCase(java.util.Locale.US))) {
            java.lang.String[] partParts = part.split("=", 2);
            if (partParts.length == 2) {
                java.lang.String parameter = partParts[1].trim();
                int len = parameter.length();
                if (((len >= 2) && parameter.startsWith("\"")) && parameter.endsWith("\"")) {
                    return parameter.substring(1, len - 1);
                } else {
                    return parameter;
                }
            }
        }
    }
    return null;
}

