    java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = new java.util.ArrayList<com.fsck.k9.mail.store.imap.ImapResponse>();
    com.fsck.k9.mail.store.imap.ImapResponse response;
    do {
        response = readResponse();
        if (com.fsck.k9.mail.K9MailLib.isDebug() && com.fsck.k9.mail.K9MailLib.DEBUG_PROTOCOL_IMAP) {
            timber.log.Timber.v("%s<<<%s", logId, response);
        }
        if ((response.getTag() != null) && (!response.getTag().equalsIgnoreCase(tag))) {
            timber.log.Timber.w("After sending tag %s, got tag response from previous command %s for %s", tag, response, logId);
            java.util.Iterator<com.fsck.k9.mail.store.imap.ImapResponse> responseIterator = responses.iterator();
            while (responseIterator.hasNext()) {
                com.fsck.k9.mail.store.imap.ImapResponse delResponse = responseIterator.next();
                if (((delResponse.getTag() != null) || (delResponse.size() < 2)) || ((!com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(delResponse.get(1), com.fsck.k9.mail.store.imap.Responses.EXISTS)) && (!com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(delResponse.get(1), com.fsck.k9.mail.store.imap.Responses.EXPUNGE)))) {
                    responseIterator.remove();
                }
            } 
            response = null;
            continue;
        }
        if ((response.getTag() == null) && (untaggedHandler != null)) {
            untaggedHandler.handleAsyncUntaggedResponse(response);
        }
        responses.add(response);
    } while ((response == null) || (response.getTag() == null) );
    if ((response.size() < 1) || (!com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(0), com.fsck.k9.mail.store.imap.Responses.OK))) {
        java.lang.String message = (("Command: " + commandToLog) + "; response: ") + response.toString();
        throw new com.fsck.k9.mail.store.imap.NegativeImapResponseException(message, responses);
    }
    return responses;
}

