/**
 * Parse a comma separated list of addresses in RFC-822 format and return an
 * array of Address objects.
 *
 * @param addressList
 * @return An array of 0 or more Addresses.
 */
public static com.fsck.k9.mail.Address[] parse(java.lang.String addressList) {
    if (android.text.TextUtils.isEmpty(addressList)) {
        return com.fsck.k9.mail.Address.EMPTY_ADDRESS_ARRAY;
    }
    java.util.List<com.fsck.k9.mail.Address> addresses = new java.util.ArrayList<>();
    try {
        org.apache.james.mime4j.dom.address.MailboxList parsedList = DefaultAddressParser.DEFAULT.parseAddressList(addressList, DecodeMonitor.SILENT).flatten();
        for (int i = 0, count = parsedList.size(); i < count; i++) {
            org.apache.james.mime4j.dom.address.Mailbox mailbox = parsedList.get(i);
            addresses.add(new com.fsck.k9.mail.Address((mailbox.getLocalPart() + "@") + mailbox.getDomain(), mailbox.getName(), false));
        }
    } catch (org.apache.james.mime4j.MimeException pe) {
        timber.log.Timber.e(pe, "MimeException in Address.parse()");
        // but we do an silent failover : we just use the given string as name with empty address
        addresses.add(new com.fsck.k9.mail.Address(null, addressList, false));
    }
    return addresses.toArray(com.fsck.k9.mail.Address.EMPTY_ADDRESS_ARRAY);
