            /* Recurse to find text parts. Since this is a multipart that is a child of a
            multipart/alternative we don't want to stop after the first text/plain part
            we find. This will allow to get all text parts for constructions like this:

            1. multipart/alternative
            1.1. multipart/mixed
            1.1.1. text/plain
            1.1.2. text/plain
            1.2. text/html
             */
            java.util.List<com.fsck.k9.mail.internet.Viewable> textViewables = com.fsck.k9.mail.internet.MessageExtractor.findTextPart(innerMultipart, false);
            if (!textViewables.isEmpty()) {
                viewables.addAll(textViewables);
                if (directChild) {
                    break;
                }
            }
        } else if (com.fsck.k9.mail.internet.MessageExtractor.isPartTextualBody(part) && com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(part.getMimeType(), "text/plain")) {
            com.fsck.k9.mail.internet.Viewable.Text text = new com.fsck.k9.mail.internet.Viewable.Text(part);
            viewables.add(text);
            if (directChild) {
                break;
            }
        }
    }
    return viewables;
}

