        return org.apache.james.mime4j.util.MimeUtil.ENC_8BIT;
    } else if (com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(type, "multipart/signed") || com.fsck.k9.mail.internet.MimeUtility.isMessage(type)) {
        return org.apache.james.mime4j.util.MimeUtil.ENC_7BIT;
    } else if (com.fsck.k9.mail.internet.MimeUtility.isMultipart(type)) {
        return org.apache.james.mime4j.util.MimeUtil.ENC_8BIT;
    } else {
