    java.lang.String userInfo;
    if (authType == com.fsck.k9.mail.AuthType.EXTERNAL) {
        userInfo = (((authType.name() + ":") + userEnc) + ":") + clientCertificateAliasEnc;
    } else {
        userInfo = (((authType.name() + ":") + userEnc) + ":") + passwordEnc;
    }
    try {
        java.util.Map<java.lang.String, java.lang.String> extra = server.getExtra();
        java.lang.String path;
        if (extra != null) {
            boolean autoDetectNamespace = java.lang.Boolean.TRUE.toString().equals(extra.get(com.fsck.k9.mail.store.imap.ImapStoreSettings.AUTODETECT_NAMESPACE_KEY));
            java.lang.String pathPrefix = (autoDetectNamespace) ? null : extra.get(com.fsck.k9.mail.store.imap.ImapStoreSettings.PATH_PREFIX_KEY);
            path = (("/" + (autoDetectNamespace ? "1" : "0")) + "|") + (pathPrefix == null ? "" : pathPrefix);
