private java.lang.String chooseAlias(java.lang.String[] keyTypes, java.security.Principal[] issuers) {
    if ((keyTypes == null) || (keyTypes.length == 0)) {
        return null;
    }
    final java.security.cert.X509Certificate cert = mChain[0];
    final java.lang.String certKeyAlg = cert.getPublicKey().getAlgorithm();
    final java.lang.String certSigAlg = cert.getSigAlgName().toUpperCase(java.util.Locale.US);
    for (java.lang.String keyAlgorithm : keyTypes) {
        if (keyAlgorithm == null) {
            continue;
        }
        final java.lang.String sigAlgorithm;
        // handle cases like EC_EC and EC_RSA
        int index = keyAlgorithm.indexOf('_');
        if (index == (-1)) {
            sigAlgorithm = null;
        } else {
            sigAlgorithm = keyAlgorithm.substring(index + 1);
            keyAlgorithm = keyAlgorithm.substring(0, index);
        }
        // key algorithm does not match
        if (!certKeyAlg.equals(keyAlgorithm)) {
            continue;
        }
        /* TODO find a more reliable test for signature
        algorithm. Unfortunately value varies with
        provider. For example for "EC" it could be
        "SHA1WithECDSA" or simply "ECDSA".
         */
        // sig algorithm does not match
        if (((sigAlgorithm != null) && (certSigAlg != null)) && (!certSigAlg.contains(sigAlgorithm))) {
            continue;
        }
        // no issuers to match
        if ((issuers == null) || (issuers.length == 0)) {
            return mAlias;
        }
        java.util.List<java.security.Principal> issuersList = java.util.Arrays.asList(issuers);
        // check that a certificate in the chain was issued by one of the specified issuers
        for (java.security.cert.X509Certificate certFromChain : mChain) {
            /* Note use of X500Principal from
            getIssuerX500Principal as opposed to Principal
            from getIssuerDN. Principal.equals test does
            not work in the case where
            xcertFromChain.getIssuerDN is a bouncycastle
            org.bouncycastle.jce.X509Principal.
             */
            javax.security.auth.x500.X500Principal issuerFromChain = certFromChain.getIssuerX500Principal();
            if (issuersList.contains(issuerFromChain)) {
                return mAlias;
            }
        }
        timber.log.Timber.w("Client certificate %s not issued by any of the requested issuers", mAlias);
        return null;
    }
    timber.log.Timber.w("Client certificate %s does not match any of the requested key types", mAlias);
    return null;
}

