    java.util.List<java.lang.String> removeMsgUids = new java.util.LinkedList<java.lang.String>();
    for (com.fsck.k9.mail.store.imap.ImapResponse response : responses) {
        oldMessageCount += processUntaggedResponse(oldMessageCount, response, flagSyncMsgSeqs, removeMsgUids);
    }
    if (!skipSync) {
        if (oldMessageCount < 0) {
            oldMessageCount = 0;
        }
        if (messageCount > oldMessageCount) {
            syncMessages(messageCount);
        }
    }
    if (com.fsck.k9.mail.K9MailLib.isDebug()) {
        timber.log.Timber.d("UIDs for messages needing flag sync are %s for %s", flagSyncMsgSeqs, getLogId());
    }
    if (!flagSyncMsgSeqs.isEmpty()) {
        syncMessages(flagSyncMsgSeqs);
    }
    if (!removeMsgUids.isEmpty()) {
        removeMessages(removeMsgUids);
    }
}

