/**
 * Fetches the full messages or up to {@param lines} lines and passes them to the message parser.
 */
private void fetchMessages(java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> messages, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.webdav.WebDavMessage> listener, int lines) throws com.fsck.k9.mail.MessagingException {
    com.fsck.k9.mail.store.webdav.WebDavHttpClient httpclient;
    httpclient = store.getHttpClient();
    /**
     * We can't hand off to processRequest() since we need the stream to parse.
     */
    for (int i = 0, count = messages.size(); i < count; i++) {
        com.fsck.k9.mail.store.webdav.WebDavMessage wdMessage = messages.get(i);
        int statusCode = 0;
        if (listener != null) {
            listener.messageStarted(wdMessage.getUid(), i, count);
        }
        /**
         * If fetch is called outside of the initial list (ie, a locally stored message), it may not have a URL
         * associated. Verify and fix that
         */
        if (wdMessage.getUrl().equals("")) {
            wdMessage.setUrl(getMessageUrls(new java.lang.String[]{ wdMessage.getUid() }).get(wdMessage.getUid()));
            timber.log.Timber.i("Fetching messages with UID = '%s', URL = '%s'", wdMessage.getUid(), wdMessage.getUrl());
            if (wdMessage.getUrl().equals("")) {
                throw new com.fsck.k9.mail.MessagingException("Unable to get URL for message");
            }
        }
        try {
            timber.log.Timber.i("Fetching message with UID = '%s', URL = '%s'", wdMessage.getUid(), wdMessage.getUrl());
            org.apache.http.client.methods.HttpGet httpget = new org.apache.http.client.methods.HttpGet(new java.net.URI(wdMessage.getUrl()));
            org.apache.http.HttpResponse response;
            org.apache.http.HttpEntity entity;
            httpget.setHeader("translate", "f");
            if (store.getAuthentication() == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_BASIC) {
                httpget.setHeader("Authorization", store.getAuthString());
            }
            response = httpclient.executeOverride(httpget, store.getHttpContext());
            statusCode = response.getStatusLine().getStatusCode();
            entity = response.getEntity();
            if ((statusCode < 200) || (statusCode > 300)) {
                throw new java.io.IOException((("Error during with code " + statusCode) + " during fetch: ") + response.getStatusLine().toString());
            }
            if (entity != null) {
                java.io.InputStream istream = null;
                java.lang.StringBuilder buffer = new java.lang.StringBuilder();
                java.lang.String tempText;
                java.lang.String resultText;
                java.io.BufferedReader reader = null;
                int currentLines = 0;
                try {
                    istream = com.fsck.k9.mail.store.webdav.WebDavHttpClient.getUngzippedContent(entity);
                    if (lines != (-1)) {
                        // Convert the ungzipped input stream into a StringBuilder
                        // containing the given line count
                        reader = new java.io.BufferedReader(new java.io.InputStreamReader(istream), 8192);
                        while (((tempText = reader.readLine()) != null) && (currentLines < lines)) {
                            buffer.append(tempText).append("\r\n");
                            currentLines++;
                        } 
                        org.apache.commons.io.IOUtils.closeQuietly(istream);
                        resultText = buffer.toString();
                        istream = new java.io.ByteArrayInputStream(resultText.getBytes("UTF-8"));
                    }
                    // Parse either the entire message stream, or a stream of the given lines
                    wdMessage.parse(istream);
                } catch (java.io.IOException ioe) {
                    timber.log.Timber.e(ioe, "IOException during message parsing");
                    throw new com.fsck.k9.mail.MessagingException("I/O Error", ioe);
                } finally {
                    org.apache.commons.io.IOUtils.closeQuietly(reader);
                    org.apache.commons.io.IOUtils.closeQuietly(istream);
                }
            } else {
                timber.log.Timber.v("Empty response");
            }
        } catch (java.lang.IllegalArgumentException iae) {
            timber.log.Timber.e(iae, "IllegalArgumentException caught");
            throw new com.fsck.k9.mail.MessagingException("IllegalArgumentException caught", iae);
        } catch (java.net.URISyntaxException use) {
            timber.log.Timber.e(use, "URISyntaxException caught");
            throw new com.fsck.k9.mail.MessagingException("URISyntaxException caught", use);
        } catch (java.io.IOException ioe) {
            timber.log.Timber.e(ioe, "Non-success response code loading message, response code was %d, URL: %s", statusCode, wdMessage.getUrl());
            throw new com.fsck.k9.mail.MessagingException("Failure code " + statusCode, ioe);
        }
        if (listener != null) {
            listener.messageFinished(wdMessage, i, count);
        }
    }
}

