/**
 * Returns a Map of message UID => ParsedMessageEnvelope
 */
public java.util.Map<java.lang.String, com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope> getMessageEnvelopes() {
    java.util.Map<java.lang.String, com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope> envelopes = new java.util.HashMap<java.lang.String, com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope>();
    for (java.lang.String uid : mData.keySet()) {
        com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope envelope = new com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope();
        java.util.Map<java.lang.String, java.lang.String> data = mData.get(uid);
        if (data != null) {
            for (java.util.Map.Entry<java.lang.String, java.lang.String> entry : data.entrySet()) {
                java.lang.String header = entry.getKey();
                if (header.equals("read")) {
                    java.lang.String read = entry.getValue();
                    boolean readStatus = !read.equals("0");
                    envelope.setReadStatus(readStatus);
                } else if (header.equals("date")) {
                    /**
                     * Exchange doesn't give us rfc822 dates like it claims. The date is in the format:
                     * yyyy-MM-dd'T'HH:mm:ss.SSS<Single digit representation of timezone, so far, all instances
                     * are Z>
                     */
                    java.lang.String date = entry.getValue();
                    date = date.substring(0, date.length() - 1);
                    java.text.DateFormat dfInput = new java.text.SimpleDateFormat("yyyy-MM-dd'T'HH:mm:ss.SSS", java.util.Locale.US);
                    java.text.DateFormat dfOutput = new java.text.SimpleDateFormat("EEE, d MMM yy HH:mm:ss Z", java.util.Locale.US);
                    java.lang.String tempDate = "";
                    try {
                        java.util.Date parsedDate = dfInput.parse(date);
                        tempDate = dfOutput.format(parsedDate);
                    } catch (java.text.ParseException pe) {
                        timber.log.Timber.e(pe, "Error parsing date: %s", date);
                    }
                    envelope.addHeader(header, tempDate);
                } else {
                    envelope.addHeader(header, entry.getValue());
                }
            }
        }
        envelopes.put(uid, envelope);
    }
    return envelopes;
}

/**
 * Computes the response for CRAM-MD5 authentication mechanism given the user credentials and
 * the server-provided nonce.
 *
 * @param username
 * 		The username.
 * @param password
 * 		The password.
 * @param b64Nonce
 * 		The nonce as base64-encoded byte array.
 * @return The CRAM-MD5 response as byte array.
 * @throws MessagingException
 * 		If something went wrong.
 * @see <a href="https://tools.ietf.org/html/rfc2195">RFC 2195</a>
 */
public static byte[] computeCramMd5Bytes(java.lang.String username, java.lang.String password, byte[] b64Nonce) throws com.fsck.k9.mail.MessagingException {
    try {
        byte[] nonce = com.fsck.k9.mail.filter.Base64.decodeBase64(b64Nonce);
        byte[] secretBytes = password.getBytes();
        java.security.MessageDigest md = java.security.MessageDigest.getInstance("MD5");
        if (secretBytes.length > 64) {
            secretBytes = md.digest(secretBytes);
        }
        byte[] ipad = new byte[64];
        byte[] opad = new byte[64];
        java.lang.System.arraycopy(secretBytes, 0, ipad, 0, secretBytes.length);
        java.lang.System.arraycopy(secretBytes, 0, opad, 0, secretBytes.length);
        for (int i = 0; i < ipad.length; i++) {
            ipad[i] ^= 0x36;
        }
        for (int i = 0; i < opad.length; i++) {
            opad[i] ^= 0x5c;
        }
        md.update(ipad);
        byte[] firstPass = md.digest(nonce);
        md.update(opad);
        byte[] result = md.digest(firstPass);
        java.lang.String plainCRAM = (username + " ") + com.fsck.k9.mail.filter.Hex.encodeHex(result);
        byte[] b64CRAM = com.fsck.k9.mail.filter.Base64.encodeBase64(plainCRAM.getBytes());
        return b64CRAM;
    } catch (java.lang.Exception e) {
        throw new com.fsck.k9.mail.MessagingException("Something went wrong during CRAM-MD5 computation", e);
    }
}

