public void open() throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    if (open) {
        return;
    } else if (stacktraceForClose != null) {
        throw new java.lang.IllegalStateException("open() called after close(). " + "Check wrapped exception to see where close() was called.", stacktraceForClose);
    }
    open = true;
    boolean authSuccess = false;
    nextCommandTag = 1;
    adjustDNSCacheTTL();
    try {
        socket = connect();
        configureSocket();
        setUpStreamsAndParserFromSocket();
        readInitialResponse();
        requestCapabilitiesIfNecessary();
        upgradeToTlsIfNecessary();
        java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = authenticate();
        authSuccess = true;
        extractOrRequestCapabilities(responses);
        enableCompressionIfRequested();
        retrievePathPrefixIfNecessary();
        retrievePathDelimiterIfNecessary();
    } catch (javax.net.ssl.SSLException e) {
        handleSslException(e);
    } catch (java.net.ConnectException e) {
        handleConnectException(e);
    } catch (java.security.GeneralSecurityException e) {
        throw new com.fsck.k9.mail.MessagingException("Unable to open connection to IMAP server due to security error.", e);
    } finally {
        if (!authSuccess) {
            timber.log.Timber.e("Failed to login, closing connection for %s", getLogId());
            close();
        }
    }
}

