/**
 * Appends the given messages to the selected folder.
 *
 * <p>
 * This implementation also determines the new UIDs of the given messages on the IMAP
 * server and changes the messages' UIDs to the new server UIDs.
 * </p>
 *
 * @param messages
 * 		The messages to append to the folder.
 * @return The mapping of original message UIDs to the new server UIDs.
 */
@java.lang.Override
public java.util.Map<java.lang.String, java.lang.String> appendMessages(java.util.List<? extends com.fsck.k9.mail.Message> messages) throws com.fsck.k9.mail.MessagingException {
    open(com.fsck.k9.mail.Folder.OPEN_MODE_RW);
    checkOpen();
    try {
        java.util.Map<java.lang.String, java.lang.String> uidMap = new java.util.HashMap<>();
        for (com.fsck.k9.mail.Message message : messages) {
            long messageSize = message.calculateSize();
            java.lang.String encodeFolderName = folderNameCodec.encode(getPrefixedName());
            java.lang.String escapedFolderName = com.fsck.k9.mail.store.imap.ImapUtility.encodeString(encodeFolderName);
            java.lang.String command = java.lang.String.format(java.util.Locale.US, "APPEND %s (%s) {%d}", escapedFolderName, combineFlags(message.getFlags()), messageSize);
            connection.sendCommand(command, false);
            com.fsck.k9.mail.store.imap.ImapResponse response;
            do {
                response = connection.readResponse();
                handleUntaggedResponse(response);
                if (response.isContinuationRequested()) {
                    com.fsck.k9.mail.filter.EOLConvertingOutputStream eolOut = new com.fsck.k9.mail.filter.EOLConvertingOutputStream(connection.getOutputStream());
                    message.writeTo(eolOut);
                    eolOut.write('\r');
                    eolOut.write('\n');
                    eolOut.flush();
                }
            } while (response.getTag() == null );
            if (response.size() > 1) {
                /* If the server supports UIDPLUS, then along with the APPEND response it
                will return an APPENDUID response code, e.g.

                11 OK [APPENDUID 2 238268] APPEND completed

                We can use the UID included in this response to update our records.
                 */
                java.lang.Object responseList = response.get(1);
                if (responseList instanceof com.fsck.k9.mail.store.imap.ImapList) {
                    com.fsck.k9.mail.store.imap.ImapList appendList = ((com.fsck.k9.mail.store.imap.ImapList) (responseList));
                    if ((appendList.size() >= 3) && appendList.getString(0).equals("APPENDUID")) {
                        java.lang.String newUid = appendList.getString(2);
                        if (!android.text.TextUtils.isEmpty(newUid)) {
                            message.setUid(newUid);
                            uidMap.put(message.getUid(), newUid);
                            continue;
                        }
                    }
                }
            }
            /* This part is executed in case the server does not support UIDPLUS or does
            not implement the APPENDUID response code.
             */
            java.lang.String newUid = getUidFromMessageId(message);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Got UID %s for message for %s", newUid, getLogId());
            }
            if (!android.text.TextUtils.isEmpty(newUid)) {
                uidMap.put(message.getUid(), newUid);
                message.setUid(newUid);
            }
        }
        /* We need uidMap to be null if new UIDs are not available to maintain consistency
        with the behavior of other similar methods (copyMessages, moveMessages) which
        return null.
         */
        return uidMap.isEmpty() ? null : uidMap;
    } catch (java.io.IOException ioe) {
        throw ioExceptionHandler(connection, ioe);
    }
}

/**
 * Creates a WebDavStore URI with the supplied settings.
 *
 * @param server
 * 		The {@link ServerSettings} object that holds the server settings.
 * @return A WebDavStore URI that holds the same information as the {@code server} parameter.
 * @see StoreConfig#getStoreUri()
 * @see WebDavStore#decodeUri(String)
 */
public static java.lang.String create(com.fsck.k9.mail.ServerSettings server) {
    java.lang.String userEnc = com.fsck.k9.mail.helper.UrlEncodingHelper.encodeUtf8(server.username);
    java.lang.String passwordEnc = (server.password != null) ? com.fsck.k9.mail.helper.UrlEncodingHelper.encodeUtf8(server.password) : "";
    java.lang.String scheme;
    switch (server.connectionSecurity) {
        case SSL_TLS_REQUIRED :
            scheme = "webdav+ssl+";
            break;
        default :
        case NONE :
            scheme = "webdav";
            break;
    }
    java.lang.String userInfo = (userEnc + ":") + passwordEnc;
    java.lang.String uriPath;
    java.util.Map<java.lang.String, java.lang.String> extra = server.getExtra();
    if (extra != null) {
        java.lang.String path = extra.get(com.fsck.k9.mail.store.webdav.WebDavStoreSettings.PATH_KEY);
        path = (path != null) ? path : "";
        java.lang.String authPath = extra.get(com.fsck.k9.mail.store.webdav.WebDavStoreSettings.AUTH_PATH_KEY);
        authPath = (authPath != null) ? authPath : "";
        java.lang.String mailboxPath = extra.get(com.fsck.k9.mail.store.webdav.WebDavStoreSettings.MAILBOX_PATH_KEY);
        mailboxPath = (mailboxPath != null) ? mailboxPath : "";
        uriPath = (((("/" + path) + "|") + authPath) + "|") + mailboxPath;
    } else {
        uriPath = "/||";
    }
    try {
        return new java.net.URI(scheme, userInfo, server.host, server.port, uriPath, null, null).toString();
    } catch (java.net.URISyntaxException e) {
        throw new java.lang.IllegalArgumentException("Can't create WebDavStore URI", e);
    }
}

