/**
 * Expand the given number range into a list of individual numbers.
 *
 * <pre>
 * sequence-number = nz-number / "*"
 * sequence-range  = sequence-number ":" sequence-number
 * sequence-set    = (sequence-number / sequence-range) *("," sequence-set)
 * </pre>
 *
 * @param range
 * 		The range string as received by the server.
 * @return The list of IDs as strings in this range. If the range is not valid, an empty list
is returned.
 */
public static java.util.List<java.lang.String> getImapRangeValues(java.lang.String range) {
    java.util.List<java.lang.String> list = new java.util.ArrayList<java.lang.String>();
    try {
        if (range != null) {
            int colonPos = range.indexOf(':');
            if (colonPos > 0) {
                long first = java.lang.Long.parseLong(range.substring(0, colonPos));
                long second = java.lang.Long.parseLong(range.substring(colonPos + 1));
                if (com.fsck.k9.mail.store.imap.ImapUtility.is32bitValue(first) && com.fsck.k9.mail.store.imap.ImapUtility.is32bitValue(second)) {
                    if (first < second) {
                        for (long i = first; i <= second; i++) {
                            list.add(java.lang.Long.toString(i));
                        }
                    } else {
                        for (long i = first; i >= second; i--) {
                            list.add(java.lang.Long.toString(i));
                        }
                    }
                } else {
                    timber.log.Timber.d("Invalid range: %s", range);
                }
            }
        }
    } catch (java.lang.NumberFormatException e) {
        timber.log.Timber.d(e, "Invalid range value: %s", range);
    }
    return list;
}

