protected static java.lang.String[] reorder(java.lang.String[] enabled, java.lang.String[] known, java.lang.String[] blacklisted) {
    java.util.List<java.lang.String> unknown = new java.util.ArrayList<java.lang.String>();
    java.util.Collections.addAll(unknown, enabled);
    // Remove blacklisted items
    if (blacklisted != null) {
        for (java.lang.String item : blacklisted) {
            unknown.remove(item);
        }
    }
    // Order known items
    java.util.List<java.lang.String> result = new java.util.ArrayList<java.lang.String>();
    for (java.lang.String item : known) {
        if (unknown.remove(item)) {
            result.add(item);
        }
    }
    // Add unknown items at the end. This way security won't get worse when unknown ciphers
    // start showing up in the future.
    result.addAll(unknown);
    return result.toArray(new java.lang.String[result.size()]);
}

public static java.util.Map<java.lang.String, java.lang.String> getAllHeaderParameters(java.lang.String headerValue) {
