    java.lang.String[] parts = headerValue.split(";");
    for (java.lang.String part : parts) {
        java.lang.String[] partParts = part.split("=", 2);
        if (partParts.length == 2) {
            java.lang.String parameterName = partParts[0].trim().toLowerCase(java.util.Locale.US);
            java.lang.String parameterValue = partParts[1].trim();
            result.put(parameterName, parameterValue);
        }
    }
    return result;
}

