/**
 * Creates a SmtpTransport URI with the supplied settings.
 *
 * @param server
 * 		The {@link ServerSettings} object that holds the server settings.
 * @return A SmtpTransport URI that holds the same information as the {@code server} parameter.
 * @see com.fsck.k9.mail.store.StoreConfig#getTransportUri()
 */
private static java.lang.String createSmtpUri(com.fsck.k9.mail.ServerSettings server) {
    java.lang.String userEnc = (server.username != null) ? com.fsck.k9.mail.TransportUris.encodeUtf8(server.username) : "";
    java.lang.String passwordEnc = (server.password != null) ? com.fsck.k9.mail.TransportUris.encodeUtf8(server.password) : "";
    java.lang.String clientCertificateAliasEnc = (server.clientCertificateAlias != null) ? com.fsck.k9.mail.TransportUris.encodeUtf8(server.clientCertificateAlias) : "";
    java.lang.String scheme;
    switch (server.connectionSecurity) {
        case SSL_TLS_REQUIRED :
            scheme = "smtp+ssl+";
            break;
        case STARTTLS_REQUIRED :
            scheme = "smtp+tls+";
            break;
        default :
        case NONE :
            scheme = "smtp";
            break;
    }
    java.lang.String userInfo;
    com.fsck.k9.mail.AuthType authType = server.authenticationType;
    // NOTE: authType is append at last item, in contrast to ImapStore and Pop3Store!
    if (authType != null) {
        if (com.fsck.k9.mail.AuthType.EXTERNAL == authType) {
            userInfo = (((userEnc + ":") + clientCertificateAliasEnc) + ":") + authType.name();
        } else {
            userInfo = (((userEnc + ":") + passwordEnc) + ":") + authType.name();
        }
    } else {
        userInfo = (userEnc + ":") + passwordEnc;
    }
    try {
        return new java.net.URI(scheme, userInfo, server.host, server.port, null, null, null).toString();
    } catch (java.net.URISyntaxException e) {
        throw new java.lang.IllegalArgumentException("Can't create SmtpTransport URI", e);
    }
}

