/**
 * Decodes a Pop3Store URI.
 *
 * <p>Possible forms:</p>
 * <pre>
 * pop3://authType:user:password@server:port
 * ConnectionSecurity.NONE
 * pop3+tls+://authType:user:password@server:port
 * ConnectionSecurity.STARTTLS_REQUIRED
 * pop3+ssl+://authType:user:password@server:port
 * ConnectionSecurity.SSL_TLS_REQUIRED
 * </pre>
 *
 * e.g.
 * <pre>pop3://PLAIN:admin:pass123@example.org:12345</pre>
 */
public static com.fsck.k9.mail.ServerSettings decodeUri(java.lang.String uri) {
    java.lang.String host;
    int port;
    com.fsck.k9.mail.ConnectionSecurity connectionSecurity;
    java.lang.String username = null;
    java.lang.String password = null;
    java.lang.String clientCertificateAlias = null;
    java.net.URI pop3Uri;
    try {
        pop3Uri = new java.net.URI(uri);
    } catch (java.net.URISyntaxException use) {
        throw new java.lang.IllegalArgumentException("Invalid Pop3Store URI", use);
    }
    java.lang.String scheme = pop3Uri.getScheme();
    /* Currently available schemes are:
    pop3
    pop3+tls+
    pop3+ssl+

    The following are obsolete schemes that may be found in pre-existing
    settings from earlier versions or that may be found when imported. We
    continue to recognize them and re-map them appropriately:
    pop3+tls
    pop3+ssl
     */
    if (scheme.equals("pop3")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.NONE;
        port = com.fsck.k9.mail.ServerSettings.Type.POP3.defaultPort;
    } else if (scheme.startsWith("pop3+tls")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.STARTTLS_REQUIRED;
        port = com.fsck.k9.mail.ServerSettings.Type.POP3.defaultPort;
    } else if (scheme.startsWith("pop3+ssl")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.SSL_TLS_REQUIRED;
        port = com.fsck.k9.mail.ServerSettings.Type.POP3.defaultTlsPort;
    } else {
        throw new java.lang.IllegalArgumentException(("Unsupported protocol (" + scheme) + ")");
    }
    host = pop3Uri.getHost();
    if (pop3Uri.getPort() != (-1)) {
        port = pop3Uri.getPort();
    }
    com.fsck.k9.mail.AuthType authType = com.fsck.k9.mail.AuthType.PLAIN;
    if (pop3Uri.getUserInfo() != null) {
        int userIndex = 0;
        int passwordIndex = 1;
        java.lang.String userinfo = pop3Uri.getUserInfo();
        java.lang.String[] userInfoParts = userinfo.split(":");
        if ((userInfoParts.length > 2) || userinfo.endsWith(":")) {
            // If 'userinfo' ends with ":" the password is empty. This can only happen
            // after an account was imported (so authType and username are present).
            userIndex++;
            passwordIndex++;
            authType = com.fsck.k9.mail.AuthType.valueOf(userInfoParts[0]);
        }
        username = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[userIndex]);
        if (userInfoParts.length > passwordIndex) {
            if (authType == com.fsck.k9.mail.AuthType.EXTERNAL) {
                clientCertificateAlias = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[passwordIndex]);
            } else {
                password = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[passwordIndex]);
            }
        }
    }
    return new com.fsck.k9.mail.ServerSettings(com.fsck.k9.mail.ServerSettings.Type.POP3, host, port, connectionSecurity, authType, username, password, clientCertificateAlias);
}

