public int read(byte[] buffer, int offset, int length) throws java.io.IOException {
    if (!peeked) {
        return in.read(buffer, offset, length);
    } else {
        buffer[offset] = ((byte) (peekedByte));
        peeked = false;
        int r = in.read(buffer, offset + 1, length - 1);
        if (r == (-1)) {
            return 1;
        } else {
            return r + 1;
        }
    }
}

