        exists = true;
        return true;
    } catch (com.fsck.k9.mail.store.imap.NegativeImapResponseException e) {
        return false;
    } catch (java.io.IOException ioe) {
        throw ioExceptionHandler(connection, ioe);
    } finally {
        if (this.connection == null) {
            store.releaseConnection(connection);
        }
    }
}

