/**
 * Decodes an ImapStore URI.
 *
 * <p>Possible forms:</p>
 * <pre>
 * imap://auth:user:password@server:port ConnectionSecurity.NONE
 * imap+tls+://auth:user:password@server:port ConnectionSecurity.STARTTLS_REQUIRED
 * imap+ssl+://auth:user:password@server:port ConnectionSecurity.SSL_TLS_REQUIRED
 * </pre>
 *
 * NOTE: this method expects the userinfo part of the uri to be encoded twice, due to a bug in
 * {@link ImapStoreUriCreator#create(ServerSettings)}.
 *
 * @param uri
 * 		the store uri.
 */
public static com.fsck.k9.mail.store.imap.ImapStoreSettings decode(java.lang.String uri) {
    java.lang.String host;
    int port;
    com.fsck.k9.mail.ConnectionSecurity connectionSecurity;
    com.fsck.k9.mail.AuthType authenticationType = null;
    java.lang.String username = null;
    java.lang.String password = null;
    java.lang.String clientCertificateAlias = null;
    java.lang.String pathPrefix = null;
    boolean autoDetectNamespace = true;
    java.net.URI imapUri;
    try {
        imapUri = new java.net.URI(uri);
    } catch (java.net.URISyntaxException use) {
        throw new java.lang.IllegalArgumentException("Invalid ImapStore URI", use);
    }
    java.lang.String scheme = imapUri.getScheme();
    /* Currently available schemes are:
    imap
    imap+tls+
    imap+ssl+

    The following are obsolete schemes that may be found in pre-existing
    settings from earlier versions or that may be found when imported. We
    continue to recognize them and re-map them appropriately:
    imap+tls
    imap+ssl
     */
    if (scheme.equals("imap")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.NONE;
        port = com.fsck.k9.mail.ServerSettings.Type.IMAP.defaultPort;
    } else if (scheme.startsWith("imap+tls")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.STARTTLS_REQUIRED;
        port = com.fsck.k9.mail.ServerSettings.Type.IMAP.defaultPort;
    } else if (scheme.startsWith("imap+ssl")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.SSL_TLS_REQUIRED;
        port = com.fsck.k9.mail.ServerSettings.Type.IMAP.defaultTlsPort;
    } else {
        throw new java.lang.IllegalArgumentException(("Unsupported protocol (" + scheme) + ")");
    }
    host = imapUri.getHost();
    if (imapUri.getPort() != (-1)) {
        port = imapUri.getPort();
    }
    if (imapUri.getUserInfo() != null) {
        java.lang.String userinfo = imapUri.getUserInfo();
        java.lang.String[] userInfoParts = userinfo.split(":");
        if (userinfo.endsWith(":")) {
            // Last field (password/certAlias) is empty.
            // For imports e.g.: PLAIN:username: or username:
            // Or XOAUTH2 where it's a valid config - XOAUTH:username:
            if (userInfoParts.length > 1) {
                authenticationType = com.fsck.k9.mail.AuthType.valueOf(userInfoParts[0]);
                username = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[1]);
            } else {
                authenticationType = com.fsck.k9.mail.AuthType.PLAIN;
                username = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[0]);
            }
        } else if (userInfoParts.length == 2) {
            // Old/standard style of encoding - PLAIN auth only:
            // username:password
            authenticationType = com.fsck.k9.mail.AuthType.PLAIN;
            username = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[0]);
            password = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[1]);
        } else if (userInfoParts.length == 3) {
            // Standard encoding
            // PLAIN:username:password
            // EXTERNAL:username:certAlias
            authenticationType = com.fsck.k9.mail.AuthType.valueOf(userInfoParts[0]);
            username = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[1]);
            if (com.fsck.k9.mail.AuthType.EXTERNAL == authenticationType) {
                clientCertificateAlias = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[2]);
            } else {
                password = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(userInfoParts[2]);
            }
        }
    }
    java.lang.String path = imapUri.getPath();
    if ((path != null) && (path.length() > 1)) {
        // Strip off the leading "/"
        java.lang.String cleanPath = path.substring(1);
        if ((cleanPath.length() >= 2) && (cleanPath.charAt(1) == '|')) {
            autoDetectNamespace = cleanPath.charAt(0) == '1';
            if (!autoDetectNamespace) {
                pathPrefix = cleanPath.substring(2);
            }
        } else if (cleanPath.length() > 0) {
            pathPrefix = cleanPath;
            autoDetectNamespace = false;
        }
    }
    return new com.fsck.k9.mail.store.imap.ImapStoreSettings(host, port, connectionSecurity, authenticationType, username, password, clientCertificateAlias, autoDetectNamespace, pathPrefix);
}

public static void setBody(com.fsck.k9.mail.Part part, com.fsck.k9.mail.Body body) throws com.fsck.k9.mail.MessagingException {
    part.setBody(body);
    if (part instanceof com.fsck.k9.mail.Message) {
        part.setHeader("MIME-Version", "1.0");
    }
    if (body instanceof com.fsck.k9.mail.Multipart) {
        com.fsck.k9.mail.Multipart multipart = ((com.fsck.k9.mail.Multipart) (body));
        multipart.setParent(part);
        java.lang.String mimeType = multipart.getMimeType();
        java.lang.String contentType = java.lang.String.format("%s; boundary=\"%s\"", mimeType, multipart.getBoundary());
        part.setHeader(com.fsck.k9.mail.internet.MimeHeader.HEADER_CONTENT_TYPE, contentType);
        // note: if this is ever changed to 8bit, multipart/signed parts must always be 7bit!
        com.fsck.k9.mail.internet.MimeMessageHelper.setEncoding(part, MimeUtil.ENC_7BIT);
    } else if (body instanceof com.fsck.k9.mail.internet.TextBody) {
        java.lang.String contentType;
        if (com.fsck.k9.mail.internet.MimeUtility.mimeTypeMatches(part.getMimeType(), "text/*")) {
            contentType = java.lang.String.format("%s;\r\n charset=utf-8", part.getMimeType());
            java.lang.String name = com.fsck.k9.mail.internet.MimeUtility.getHeaderParameter(part.getContentType(), "name");
            if (name != null) {
                contentType += java.lang.String.format(";\r\n name=\"%s\"", name);
            }
        } else {
            contentType = part.getMimeType();
        }
        part.setHeader(com.fsck.k9.mail.internet.MimeHeader.HEADER_CONTENT_TYPE, contentType);
        com.fsck.k9.mail.internet.MimeMessageHelper.setEncoding(part, MimeUtil.ENC_QUOTED_PRINTABLE);
    } else if (body instanceof com.fsck.k9.mail.internet.RawDataBody) {
        java.lang.String encoding = ((com.fsck.k9.mail.internet.RawDataBody) (body)).getEncoding();
        part.setHeader(com.fsck.k9.mail.internet.MimeHeader.HEADER_CONTENT_TRANSFER_ENCODING, encoding);
    }
}

@java.lang.Override
public void writeTo(java.io.OutputStream out) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    java.io.BufferedWriter writer = new java.io.BufferedWriter(new java.io.OutputStreamWriter(out), 1024);
    if (preamble != null) {
        out.write(preamble);
        writer.write("\r\n");
    }
    if (getBodyParts().isEmpty()) {
        writer.write("--");
        writer.write(boundary);
        writer.write("\r\n");
    } else {
        for (com.fsck.k9.mail.BodyPart bodyPart : getBodyParts()) {
            writer.write("--");
            writer.write(boundary);
            writer.write("\r\n");
            writer.flush();
            bodyPart.writeTo(out);
            writer.write("\r\n");
        }
    }
    writer.write("--");
    writer.write(boundary);
    writer.write("--\r\n");
    writer.flush();
    if (epilogue != null) {
        out.write(epilogue);
    }
}

