/**
 * Traverse the MIME tree of a message and extract viewable parts.
 */
public static void findViewablesAndAttachments(com.fsck.k9.mail.Part part, @android.support.annotation.Nullable
java.util.List<com.fsck.k9.mail.internet.Viewable> outputViewableParts, @android.support.annotation.Nullable
java.util.List<com.fsck.k9.mail.Part> outputNonViewableParts) throws com.fsck.k9.mail.MessagingException {
    boolean skipSavingNonViewableParts = outputNonViewableParts == null;
    boolean skipSavingViewableParts = outputViewableParts == null;
    if (skipSavingNonViewableParts && skipSavingViewableParts) {
        throw new java.lang.IllegalArgumentException("method was called but no output is to be collected - this a bug!");
    }
    com.fsck.k9.mail.Body body = part.getBody();
    if (body instanceof com.fsck.k9.mail.Multipart) {
        com.fsck.k9.mail.Multipart multipart = ((com.fsck.k9.mail.Multipart) (body));
        if (com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(part.getMimeType(), "multipart/alternative")) {
            /* For multipart/alternative parts we try to find a text/plain and a text/html
            child. Everything else we find is put into 'attachments'.
             */
            java.util.List<com.fsck.k9.mail.internet.Viewable> text = com.fsck.k9.mail.internet.MessageExtractor.findTextPart(multipart, true);
            java.util.Set<com.fsck.k9.mail.Part> knownTextParts = com.fsck.k9.mail.internet.MessageExtractor.getParts(text);
            java.util.List<com.fsck.k9.mail.internet.Viewable> html = com.fsck.k9.mail.internet.MessageExtractor.findHtmlPart(multipart, knownTextParts, outputNonViewableParts, true);
            if (skipSavingViewableParts) {
                return;
            }
            if ((!text.isEmpty()) || (!html.isEmpty())) {
                com.fsck.k9.mail.internet.Viewable.Alternative alternative = new com.fsck.k9.mail.internet.Viewable.Alternative(text, html);
                outputViewableParts.add(alternative);
            }
        } else if (com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(part.getMimeType(), "multipart/signed")) {
            if (multipart.getCount() > 0) {
                com.fsck.k9.mail.BodyPart bodyPart = multipart.getBodyPart(0);
                com.fsck.k9.mail.internet.MessageExtractor.findViewablesAndAttachments(bodyPart, outputViewableParts, outputNonViewableParts);
            }
        } else {
            // For all other multipart parts we recurse to grab all viewable children.
            for (com.fsck.k9.mail.Part bodyPart : multipart.getBodyParts()) {
                com.fsck.k9.mail.internet.MessageExtractor.findViewablesAndAttachments(bodyPart, outputViewableParts, outputNonViewableParts);
            }
        }
    } else if ((body instanceof com.fsck.k9.mail.Message) && (!"attachment".equalsIgnoreCase(com.fsck.k9.mail.internet.MessageExtractor.getContentDisposition(part)))) {
        if (skipSavingViewableParts) {
            return;
        }
        /* We only care about message/rfc822 parts whose Content-Disposition header has a value
        other than "attachment".
         */
        com.fsck.k9.mail.Message message = ((com.fsck.k9.mail.Message) (body));
        // We add the Message object so we can extract the filename later.
        outputViewableParts.add(new com.fsck.k9.mail.internet.Viewable.MessageHeader(part, message));
        // Recurse to grab all viewable parts and attachments from that message.
        com.fsck.k9.mail.internet.MessageExtractor.findViewablesAndAttachments(message, outputViewableParts, outputNonViewableParts);
    } else if (com.fsck.k9.mail.internet.MessageExtractor.isPartTextualBody(part)) {
        if (skipSavingViewableParts) {
            return;
        }
        java.lang.String mimeType = part.getMimeType();
        com.fsck.k9.mail.internet.Viewable viewable;
        if (com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(mimeType, "text/plain")) {
            if (com.fsck.k9.mail.internet.FlowedMessageUtils.isFormatFlowed(part.getContentType())) {
                boolean delSp = com.fsck.k9.mail.internet.FlowedMessageUtils.isDelSp(part.getContentType());
                viewable = new com.fsck.k9.mail.internet.Viewable.Flowed(part, delSp);
            } else {
                viewable = new com.fsck.k9.mail.internet.Viewable.Text(part);
            }
        } else {
            viewable = new com.fsck.k9.mail.internet.Viewable.Html(part);
        }
        outputViewableParts.add(viewable);
    } else if (com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(part.getMimeType(), "application/pgp-signature")) {
        // ignore this type explicitly
    } else {
        if (skipSavingNonViewableParts) {
            return;
        }
        // Everything else is treated as attachment.
        outputNonViewableParts.add(part);
    }
}

/**
 * Handle an untagged response that the caller doesn't care to handle themselves.
 */
protected void handleUntaggedResponse(com.fsck.k9.mail.store.imap.ImapResponse response) {
    if ((response.getTag() == null) && (response.size() > 1)) {
        if (com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(1), "EXISTS")) {
            messageCount = response.getNumber(0);
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Got untagged EXISTS with value %d for %s", messageCount, getLogId());
            }
        }
        handlePossibleUidNext(response);
        if (com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(1), "EXPUNGE") && (messageCount > 0)) {
            messageCount--;
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("Got untagged EXPUNGE with messageCount %d for %s", messageCount, getLogId());
            }
        }
    }
}

