/**
 * Reads the next response available on the stream and returns an {@code ImapResponse} object that represents it.
 */
public com.fsck.k9.mail.store.imap.ImapResponse readResponse(com.fsck.k9.mail.store.imap.ImapResponseCallback callback) throws java.io.IOException {
    try {
        int peek = inputStream.peek();
        if (peek == '+') {
            readContinuationRequest(callback);
        } else if (peek == '*') {
            readUntaggedResponse(callback);
        } else {
            readTaggedResponse(callback);
        }
        if (exception != null) {
            throw new com.fsck.k9.mail.store.imap.ImapResponseParserException("readResponse(): Exception in callback method", exception);
        }
        return response;
    } finally {
        response = null;
        exception = null;
    }
}

private java.util.List<com.fsck.k9.mail.store.imap.ImapMessage> search(com.fsck.k9.mail.store.imap.ImapSearcher searcher, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.imap.ImapMessage> listener) throws com.fsck.k9.mail.MessagingException {
    checkOpen();
    java.util.List<com.fsck.k9.mail.store.imap.ImapMessage> messages = new java.util.ArrayList<>();
    try {
        java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = searcher.search();
        com.fsck.k9.mail.store.imap.SearchResponse searchResponse = com.fsck.k9.mail.store.imap.SearchResponse.parse(responses);
        java.util.List<java.lang.Long> uids = searchResponse.getNumbers();
        // Sort the uids in numerically decreasing order
        // By doing it in decreasing order, we ensure newest messages are dealt with first
        // This makes the most sense when a limit is imposed, and also prevents UI from going
        // crazy adding stuff at the top.
        java.util.Collections.sort(uids, java.util.Collections.reverseOrder());
        for (int i = 0, count = uids.size(); i < count; i++) {
            java.lang.String uid = uids.get(i).toString();
            if (listener != null) {
                listener.messageStarted(uid, i, count);
            }
            com.fsck.k9.mail.store.imap.ImapMessage message = new com.fsck.k9.mail.store.imap.ImapMessage(uid, this);
            messages.add(message);
            if (listener != null) {
                listener.messageFinished(message, i, count);
            }
        }
    } catch (java.io.IOException ioe) {
        throw ioExceptionHandler(connection, ioe);
    }
    return messages;
}

