@java.lang.Override
public void write(int oneByte) throws java.io.IOException {
    if (oneByte == '\r') {
        state = com.fsck.k9.mail.filter.SmtpDataStuffing.STATE_CR;
    } else if ((state == com.fsck.k9.mail.filter.SmtpDataStuffing.STATE_CR) && (oneByte == '\n')) {
        state = com.fsck.k9.mail.filter.SmtpDataStuffing.STATE_CRLF;
    } else if ((state == com.fsck.k9.mail.filter.SmtpDataStuffing.STATE_CRLF) && (oneByte == '.')) {
        // Read <CR><LF><DOT> so this line needs an additional period.
        super.write('.');
        state = com.fsck.k9.mail.filter.SmtpDataStuffing.STATE_NORMAL;
    } else {
        state = com.fsck.k9.mail.filter.SmtpDataStuffing.STATE_NORMAL;
    }
    super.write(oneByte);
}

