public void setUrl(java.lang.String url) {
    // TODO: This is a not as ugly hack (ie, it will actually work). But it's still horrible
    // XXX: prevent URLs from getting to us that are broken
    if (!url.toLowerCase(java.util.Locale.US).contains("http")) {
        if (!url.startsWith("/")) {
            url = "/" + url;
        }
        url = ((com.fsck.k9.mail.store.webdav.WebDavFolder) (mFolder)).getUrl() + url;
    }
    java.lang.String[] urlParts = url.split("/");
    int length = urlParts.length;
    java.lang.String end = urlParts[length - 1];
    this.mUrl = "";
    url = "";
    /**
     * We have to decode, then encode the URL because Exchange likes to not properly encode all characters
     */
    try {
        end = com.fsck.k9.mail.helper.UrlEncodingHelper.decodeUtf8(end);
        end = com.fsck.k9.mail.helper.UrlEncodingHelper.encodeUtf8(end);
        end = end.replaceAll("\\+", "%20");
    } catch (java.lang.IllegalArgumentException iae) {
        timber.log.Timber.e(iae, "IllegalArgumentException caught in setUrl: ");
    }
    for (int i = 0; i < (length - 1); i++) {
        if (i != 0) {
            url = (url + "/") + urlParts[i];
        } else {
            url = urlParts[i];
        }
    }
    url = (url + "/") + end;
    this.mUrl = url;
}

