private java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> login() throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    /* Use quoted strings which permit spaces and quotes. (Using IMAP
    string literals would be better, but some servers are broken
    and don't parse them correctly.)
     */
    // escape double-quotes and backslash characters with a backslash
    java.util.regex.Pattern p = java.util.regex.Pattern.compile("[\\\\\"]");
    java.lang.String replacement = "\\\\$0";
    java.lang.String username = p.matcher(settings.getUsername()).replaceAll(replacement);
    java.lang.String password = p.matcher(settings.getPassword()).replaceAll(replacement);
    try {
        java.lang.String command = java.lang.String.format(com.fsck.k9.mail.store.imap.Commands.LOGIN + " \"%s\" \"%s\"", username, password);
        return executeSimpleCommand(command, true);
    } catch (com.fsck.k9.mail.store.imap.NegativeImapResponseException e) {
        throw handleAuthenticationFailure(e);
    }
}

public java.util.List<? extends com.fsck.k9.mail.Message> appendWebDavMessages(java.util.List<? extends com.fsck.k9.mail.Message> messages) throws com.fsck.k9.mail.MessagingException {
    java.util.List<com.fsck.k9.mail.Message> retMessages = new java.util.ArrayList<com.fsck.k9.mail.Message>(messages.size());
    com.fsck.k9.mail.store.webdav.WebDavHttpClient httpclient = store.getHttpClient();
    for (com.fsck.k9.mail.Message message : messages) {
        com.fsck.k9.mail.store.webdav.HttpGeneric httpmethod;
        org.apache.http.HttpResponse response;
        org.apache.http.entity.StringEntity bodyEntity;
        int statusCode;
        try {
            java.io.ByteArrayOutputStream out;
            long size = message.getSize();
            if (size > java.lang.Integer.MAX_VALUE) {
                throw new com.fsck.k9.mail.MessagingException("message size > Integer.MAX_VALUE!");
            }
            out = new java.io.ByteArrayOutputStream(((int) (size)));
            open(com.fsck.k9.mail.Folder.OPEN_MODE_RW);
            com.fsck.k9.mail.filter.EOLConvertingOutputStream msgOut = new com.fsck.k9.mail.filter.EOLConvertingOutputStream(new java.io.BufferedOutputStream(out, 1024));
            message.writeTo(msgOut);
            msgOut.flush();
            bodyEntity = new org.apache.http.entity.StringEntity(out.toString(), "UTF-8");
            bodyEntity.setContentType("message/rfc822");
            java.lang.String messageURL = mFolderUrl;
            if (!messageURL.endsWith("/")) {
                messageURL += "/";
            }
            messageURL += com.fsck.k9.mail.helper.UrlEncodingHelper.encodeUtf8(((message.getUid() + ":") + java.lang.System.currentTimeMillis()) + ".eml");
            timber.log.Timber.i("Uploading message as %s", messageURL);
            store.sendRequest(messageURL, "PUT", bodyEntity, null, true);
            com.fsck.k9.mail.store.webdav.WebDavMessage retMessage = new com.fsck.k9.mail.store.webdav.WebDavMessage(message.getUid(), this);
            retMessage.setUrl(messageURL);
            retMessages.add(retMessage);
        } catch (java.lang.Exception e) {
            throw new com.fsck.k9.mail.MessagingException("Unable to append", e);
        }
    }
    return retMessages;
}

private static java.lang.String encodeB(java.lang.String prefix, java.lang.String text, java.nio.charset.Charset charset, byte[] bytes) {
    int encodedLength = com.fsck.k9.mail.internet.EncoderUtil.bEncodedLength(bytes);
    int totalLength = (prefix.length() + encodedLength) + com.fsck.k9.mail.internet.EncoderUtil.ENC_WORD_SUFFIX.length();
    if (totalLength <= com.fsck.k9.mail.internet.EncoderUtil.ENCODED_WORD_MAX_LENGTH) {
        return (prefix + org.apache.james.mime4j.codec.EncoderUtil.encodeB(bytes)) + com.fsck.k9.mail.internet.EncoderUtil.ENC_WORD_SUFFIX;
    } else {
        java.lang.String part1 = text.substring(0, text.length() / 2);
        byte[] bytes1 = com.fsck.k9.mail.internet.EncoderUtil.encode(part1, charset);
        java.lang.String word1 = com.fsck.k9.mail.internet.EncoderUtil.encodeB(prefix, part1, charset, bytes1);
        java.lang.String part2 = text.substring(text.length() / 2);
        byte[] bytes2 = com.fsck.k9.mail.internet.EncoderUtil.encode(part2, charset);
        java.lang.String word2 = com.fsck.k9.mail.internet.EncoderUtil.encodeB(prefix, part2, charset, bytes2);
        return (word1 + " ") + word2;
    }
}

com.fsck.k9.mail.store.webdav.DataSet processRequest(java.lang.String url, java.lang.String method, java.lang.String messageBody, java.util.Map<java.lang.String, java.lang.String> headers, boolean needsParsing) throws com.fsck.k9.mail.MessagingException {
    com.fsck.k9.mail.store.webdav.DataSet dataset = new com.fsck.k9.mail.store.webdav.DataSet();
    if (com.fsck.k9.mail.K9MailLib.isDebug() && com.fsck.k9.mail.K9MailLib.DEBUG_PROTOCOL_WEBDAV) {
        timber.log.Timber.v("processRequest url = '%s', method = '%s', messageBody = '%s'", url, method, messageBody);
    }
    if ((url == null) || (method == null)) {
        return dataset;
    }
    getHttpClient();
    try {
        org.apache.http.entity.StringEntity messageEntity = null;
        if (messageBody != null) {
            messageEntity = new org.apache.http.entity.StringEntity(messageBody);
            messageEntity.setContentType("text/xml");
        }
        java.io.InputStream istream = sendRequest(url, method, messageEntity, headers, true);
        if ((istream != null) && needsParsing) {
            try {
                javax.xml.parsers.SAXParserFactory spf = javax.xml.parsers.SAXParserFactory.newInstance();
                spf.setNamespaceAware(true);// This should be a no-op on Android, but makes the tests work

                javax.xml.parsers.SAXParser sp = spf.newSAXParser();
                org.xml.sax.XMLReader xr = sp.getXMLReader();
                com.fsck.k9.mail.store.webdav.WebDavHandler myHandler = new com.fsck.k9.mail.store.webdav.WebDavHandler();
                xr.setContentHandler(myHandler);
                xr.parse(new org.xml.sax.InputSource(istream));
                dataset = myHandler.getDataSet();
            } catch (org.xml.sax.SAXException se) {
                timber.log.Timber.e(se, "SAXException in processRequest()");
                throw new com.fsck.k9.mail.MessagingException("SAXException in processRequest() ", se);
            } catch (javax.xml.parsers.ParserConfigurationException pce) {
                timber.log.Timber.e(pce, "ParserConfigurationException in processRequest()");
                throw new com.fsck.k9.mail.MessagingException("ParserConfigurationException in processRequest() ", pce);
            }
            istream.close();
        }
    } catch (java.io.UnsupportedEncodingException uee) {
        timber.log.Timber.e(uee, "UnsupportedEncodingException: ");
        throw new com.fsck.k9.mail.MessagingException("UnsupportedEncodingException in processRequest() ", uee);
    } catch (java.io.IOException ioe) {
        timber.log.Timber.e(ioe, "IOException: ");
        throw new com.fsck.k9.mail.MessagingException("IOException in processRequest() ", ioe);
    }
    return dataset;
}

