private void performFormBasedAuthentication(com.fsck.k9.mail.store.webdav.ConnectionInfo info) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    // Clear out cookies from any previous authentication.
    if (authCookies != null) {
        authCookies.clear();
    }
    com.fsck.k9.mail.store.webdav.WebDavHttpClient httpClient = getHttpClient();
    java.lang.String loginUrl;
    if (info != null) {
        loginUrl = info.guessedAuthUrl;
    } else if ((cachedLoginUrl != null) && (!cachedLoginUrl.equals(""))) {
        loginUrl = cachedLoginUrl;
    } else {
        throw new com.fsck.k9.mail.MessagingException("No valid login URL available for form-based authentication.");
    }
    com.fsck.k9.mail.store.webdav.HttpGeneric request = new com.fsck.k9.mail.store.webdav.HttpGeneric(loginUrl);
    request.setMethod("POST");
    // Build the POST data.
    java.util.List<org.apache.http.message.BasicNameValuePair> pairs = new java.util.ArrayList<>();
    pairs.add(new org.apache.http.message.BasicNameValuePair("destination", baseUrl));
    pairs.add(new org.apache.http.message.BasicNameValuePair("username", username));
    pairs.add(new org.apache.http.message.BasicNameValuePair("password", password));
    pairs.add(new org.apache.http.message.BasicNameValuePair("flags", "0"));
    pairs.add(new org.apache.http.message.BasicNameValuePair("SubmitCreds", "Log+On"));
    pairs.add(new org.apache.http.message.BasicNameValuePair("forcedownlevel", "0"));
    pairs.add(new org.apache.http.message.BasicNameValuePair("trusted", "0"));
    org.apache.http.client.entity.UrlEncodedFormEntity formEntity = new org.apache.http.client.entity.UrlEncodedFormEntity(pairs);
    request.setEntity(formEntity);
    org.apache.http.HttpResponse response = httpClient.executeOverride(request, httpContext);
    boolean authenticated = testAuthenticationResponse(response);
    if (!authenticated) {
        // Check the response from the authentication request above for a form action.
        java.lang.String formAction = findFormAction(com.fsck.k9.mail.store.webdav.WebDavHttpClient.getUngzippedContent(response.getEntity()));
        if (formAction == null) {
            // If there is no form action, try using our redirect URL from the initial connection.
            if (((info != null) && (info.redirectUrl != null)) && (!info.redirectUrl.equals(""))) {
                loginUrl = info.redirectUrl;
                request = new com.fsck.k9.mail.store.webdav.HttpGeneric(loginUrl);
                request.setMethod("GET");
                response = httpClient.executeOverride(request, httpContext);
                formAction = findFormAction(com.fsck.k9.mail.store.webdav.WebDavHttpClient.getUngzippedContent(response.getEntity()));
            }
        }
        if (formAction != null) {
            try {
                java.net.URI formActionUri = new java.net.URI(formAction);
                java.net.URI loginUri = new java.net.URI(loginUrl);
                if (formActionUri.isAbsolute()) {
                    // The form action is an absolute URL, just use it.
                    loginUrl = formAction;
                } else {
                    // Append the form action to our current URL, minus the file name.
                    java.lang.String urlPath;
                    if (formAction.startsWith("/")) {
                        urlPath = formAction;
                    } else {
                        urlPath = loginUri.getPath();
                        int lastPathPos = urlPath.lastIndexOf('/');
                        if (lastPathPos > (-1)) {
                            urlPath = urlPath.substring(0, lastPathPos + 1);
                            urlPath = urlPath.concat(formAction);
                        }
                    }
                    // Reconstruct the login URL based on the original login URL and the form action.
                    java.net.URI finalUri = new java.net.URI(loginUri.getScheme(), loginUri.getUserInfo(), loginUri.getHost(), loginUri.getPort(), urlPath, null, null);
                    loginUrl = finalUri.toString();
                }
                // Retry the login using our new URL.
                request = new com.fsck.k9.mail.store.webdav.HttpGeneric(loginUrl);
                request.setMethod("POST");
                request.setEntity(formEntity);
                response = httpClient.executeOverride(request, httpContext);
                authenticated = testAuthenticationResponse(response);
            } catch (java.net.URISyntaxException e) {
                timber.log.Timber.e(e, "URISyntaxException caught");
                throw new com.fsck.k9.mail.MessagingException("URISyntaxException caught", e);
            }
        } else {
            throw new com.fsck.k9.mail.MessagingException("A valid URL for Exchange authentication could not be found.");
        }
    }
    if (authenticated) {
        authenticationType = com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_FORM_BASED;
        cachedLoginUrl = loginUrl;
    } else {
        throw new com.fsck.k9.mail.MessagingException("Invalid credentials provided for authentication.");
    }
}

