private static java.nio.charset.Charset determineCharset(java.lang.String text) {
    // it is an important property of iso-8859-1 that it directly maps
    // unicode code points 0000 to 00ff to byte values 00 to ff.
    boolean ascii = true;
    final int len = text.length();
    for (int index = 0; index < len; index++) {
        char ch = text.charAt(index);
        if (ch > 0xff) {
            return org.apache.james.mime4j.Charsets.UTF_8;
        }
        if (ch > 0x7f) {
            ascii = false;
        }
    }
    return ascii ? org.apache.james.mime4j.Charsets.US_ASCII : org.apache.james.mime4j.Charsets.ISO_8859_1;
}

/**
 * Unpacks an address list previously packed with packAddressList()
 *
 * @param addressList
 * 		Packed address list.
 * @return Unpacked list.
 */
public static com.fsck.k9.mail.Address[] unpack(java.lang.String addressList) {
    if (addressList == null) {
        return new com.fsck.k9.mail.Address[]{  };
    }
    java.util.List<com.fsck.k9.mail.Address> addresses = new java.util.ArrayList<com.fsck.k9.mail.Address>();
    int length = addressList.length();
    int pairStartIndex = 0;
    int pairEndIndex = 0;
    int addressEndIndex = 0;
    while (pairStartIndex < length) {
        pairEndIndex = addressList.indexOf(",\u0000", pairStartIndex);
        if (pairEndIndex == (-1)) {
            pairEndIndex = length;
        }
        addressEndIndex = addressList.indexOf(";\u0000", pairStartIndex);
        java.lang.String address = null;
        java.lang.String personal = null;
        if ((addressEndIndex == (-1)) || (addressEndIndex > pairEndIndex)) {
            address = addressList.substring(pairStartIndex, pairEndIndex);
        } else {
            address = addressList.substring(pairStartIndex, addressEndIndex);
            personal = addressList.substring(addressEndIndex + 2, pairEndIndex);
        }
        addresses.add(new com.fsck.k9.mail.Address(address, personal, false));
        pairStartIndex = pairEndIndex + 2;
    } 
    return addresses.toArray(new com.fsck.k9.mail.Address[addresses.size()]);
}

