            com.fsck.k9.mail.store.webdav.ConnectionInfo info = doInitialConnection();
            if (info.requiredAuthType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_BASIC) {
                com.fsck.k9.mail.store.webdav.HttpGeneric request = new com.fsck.k9.mail.store.webdav.HttpGeneric(baseUrl);
