                } else if (statusCode == 401) {
                    throw new com.fsck.k9.mail.MessagingException("Invalid username or password for authentication.");
                } else {
                    throw new com.fsck.k9.mail.MessagingException((("Error with code " + response.getStatusLine().getStatusCode()) + " during request processing: ") + response.getStatusLine().toString());
                }
            } else if (info.requiredAuthType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_FORM_BASED) {
                performFormBasedAuthentication(info);
            }
        } else if (authenticationType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_BASIC) {
