            // using basic authentication.
        } else if (authenticationType == com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_FORM_BASED) {
            // Our cookie expired, re-authenticate.
            performFormBasedAuthentication(null);
        }
    } catch (java.io.IOException ioe) {
        timber.log.Timber.e(ioe, "Error during authentication");
        throw new com.fsck.k9.mail.MessagingException("Error during authentication", ioe);
    }
    return authenticationType != com.fsck.k9.mail.store.webdav.WebDavConstants.AUTH_TYPE_NONE;
}

