        java.lang.String encoding = rawDataBody.getEncoding();
        final java.io.InputStream rawInputStream = rawDataBody.getInputStream();
        if ((MimeUtil.ENC_7BIT.equalsIgnoreCase(encoding) || MimeUtil.ENC_8BIT.equalsIgnoreCase(encoding)) || MimeUtil.ENC_BINARY.equalsIgnoreCase(encoding)) {
            inputStream = rawInputStream;
        } else if (MimeUtil.ENC_BASE64.equalsIgnoreCase(encoding)) {
