        } else if (MimeUtil.ENC_QUOTED_PRINTABLE.equalsIgnoreCase(encoding)) {
            inputStream = new org.apache.james.mime4j.codec.QuotedPrintableInputStream(rawInputStream) {
                @java.lang.Override
                public void close() throws java.io.IOException {
