/**
 * Encodes binary data using the base64 algorithm, optionally chunking the output into 76 character blocks.
 *
 * @param binaryData
 * 		Array containing binary data to encode.
 * @param isChunked
 * 		if <code>true</code> this encoder will chunk the base64 output into 76 character blocks
 * @return Base64-encoded data.
 * @throws IllegalArgumentException
 * 		Thrown when the input array needs an output array bigger than {@link Integer#MAX_VALUE}
 */
public static byte[] encodeBase64(byte[] binaryData, boolean isChunked) {
    if ((binaryData == null) || (binaryData.length == 0)) {
        return binaryData;
    }
    com.fsck.k9.mail.filter.Base64 b64 = (isChunked) ? new com.fsck.k9.mail.filter.Base64() : new com.fsck.k9.mail.filter.Base64(0);
    long len = (binaryData.length * 4) / 3;
    long mod = len % 4;
    if (mod != 0) {
        len += 4 - mod;
    }
    if (isChunked) {
        len += (1 + (len / com.fsck.k9.mail.filter.Base64.CHUNK_SIZE)) * com.fsck.k9.mail.filter.Base64.CHUNK_SEPARATOR.length;
    }
    if (len > java.lang.Integer.MAX_VALUE) {
        throw new java.lang.IllegalArgumentException("Input array too big, output array would be bigger than Integer.MAX_VALUE=" + java.lang.Integer.MAX_VALUE);
    }
    byte[] buf = new byte[((int) (len))];
    b64.setInitialBuffer(buf, 0, buf.length);
    b64.encode(binaryData, 0, binaryData.length);
    b64.encode(binaryData, 0, -1);// Notify encoder of EOF.

    // Encoder might have resized, even though it was unnecessary.
    if (b64.buf != buf) {
        b64.readResults(buf, 0, buf.length);
    }
    return buf;
}

