        java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = executeSimpleCommand(java.lang.String.format("UID COPY %s %s", com.fsck.k9.mail.store.imap.ImapFolder.combine(uids, ','), escapedDestinationFolderName));
