        com.fsck.k9.mail.store.imap.ImapResponse response = com.fsck.k9.mail.store.imap.ImapUtility.getLastResponse(responses);
        com.fsck.k9.mail.store.imap.CopyUidResponse copyUidResponse = com.fsck.k9.mail.store.imap.CopyUidResponse.parse(response);
        if (copyUidResponse == null) {
