                                break;
                            }
                        case FLAGGED :
                            {
                                imapQuery += "UNFLAGGED ";
                                break;
                            }
                        case DRAFT :
                            {
                                imapQuery += "UNDRAFT ";
                                break;
                            }
                        case RECENT :
                            {
                                imapQuery += "UNRECENT ";
                                break;
                            }
