/**
 * Fetches the body of the given message, limiting the downloaded data to the specified
 * number of lines if possible.
 *
 * If lines is -1 the entire message is fetched. This is implemented with RETR for
 * lines = -1 or TOP for any other value. If the server does not support TOP, RETR is used
 * instead.
 */
private void fetchBody(com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Message message, int lines) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    java.lang.String response = null;
    // Try hard to use the TOP command if we're not asked to download the whole message.
    if ((lines != (-1)) && ((!mTopNotSupported) || mCapabilities.top)) {
        try {
            if ((com.fsck.k9.mail.K9MailLib.isDebug() && com.fsck.k9.mail.K9MailLib.DEBUG_PROTOCOL_POP3) && (!mCapabilities.top)) {
                timber.log.Timber.d("This server doesn't support the CAPA command. " + "Checking to see if the TOP command is supported nevertheless.");
            }
            response = executeSimpleCommand(java.lang.String.format(java.util.Locale.US, com.fsck.k9.mail.store.pop3.Pop3Store.TOP_COMMAND + " %d %d", mUidToMsgNumMap.get(message.getUid()), lines));
            // TOP command is supported. Remember this for the next time.
            mCapabilities.top = true;
        } catch (com.fsck.k9.mail.store.pop3.Pop3Store.Pop3ErrorResponse e) {
            if (mCapabilities.top) {
                // The TOP command should be supported but something went wrong.
                throw e;
            } else {
                if (com.fsck.k9.mail.K9MailLib.isDebug() && com.fsck.k9.mail.K9MailLib.DEBUG_PROTOCOL_POP3) {
                    timber.log.Timber.d("The server really doesn't support the TOP " + "command. Using RETR instead.");
                }
                // Don't try to use the TOP command again.
                mTopNotSupported = true;
            }
        }
    }
    if (response == null) {
        executeSimpleCommand(java.lang.String.format(java.util.Locale.US, com.fsck.k9.mail.store.pop3.Pop3Store.RETR_COMMAND + " %d", mUidToMsgNumMap.get(message.getUid())));
    }
    try {
        message.parse(new com.fsck.k9.mail.store.pop3.Pop3Store.Pop3ResponseInputStream(mIn));
        // TODO: if we've received fewer lines than requested we also have the complete message.
        if ((lines == (-1)) || (!mCapabilities.top)) {
            message.setFlag(com.fsck.k9.mail.Flag.X_DOWNLOADED_FULL, true);
        }
    } catch (com.fsck.k9.mail.MessagingException me) {
        /* If we're only downloading headers it's possible
        we'll get a broken MIME message which we're not
        real worried about. If we've downloaded the body
        and can't parse it we need to let the user know.
         */
        if (lines == (-1)) {
            throw me;
        }
    }
}

