/**
 * Fetches and parses the message envelopes for the supplied messages. The idea is to have this be recursive so
 * that we do a series of medium calls instead of one large massive call or a large number of smaller calls.
 * Call it a happy balance
 */
private void fetchEnvelope(java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> startMessages, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.webdav.WebDavMessage> listener) throws com.fsck.k9.mail.MessagingException {
    java.util.Map<java.lang.String, java.lang.String> headers = new java.util.HashMap<java.lang.String, java.lang.String>();
    java.lang.String messageBody;
    java.lang.String[] uids;
    java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> messages = new java.util.ArrayList<com.fsck.k9.mail.store.webdav.WebDavMessage>(10);
    if ((startMessages == null) || startMessages.isEmpty()) {
        return;
    }
    if (startMessages.size() > 10) {
        java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> newMessages = new java.util.ArrayList<com.fsck.k9.mail.store.webdav.WebDavMessage>(startMessages.size() - 10);
        for (int i = 0, count = startMessages.size(); i < count; i++) {
            if (i < 10) {
                messages.add(i, startMessages.get(i));
            } else {
                newMessages.add(i - 10, startMessages.get(i));
            }
        }
        fetchEnvelope(newMessages, listener);
    } else {
        messages.addAll(startMessages);
    }
    uids = new java.lang.String[messages.size()];
    for (int i = 0, count = messages.size(); i < count; i++) {
        uids[i] = messages.get(i).getUid();
    }
    messageBody = store.getMessageEnvelopeXml(uids);
    headers.put("Brief", "t");
    com.fsck.k9.mail.store.webdav.DataSet dataset = store.processRequest(this.mFolderUrl, "SEARCH", messageBody, headers);
    java.util.Map<java.lang.String, com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope> envelopes = dataset.getMessageEnvelopes();
    int count = messages.size();
    for (int i = messages.size() - 1; i >= 0; i--) {
        com.fsck.k9.mail.store.webdav.WebDavMessage message = messages.get(i);
        if (listener != null) {
            listener.messageStarted(messages.get(i).getUid(), i, count);
        }
        com.fsck.k9.mail.store.webdav.ParsedMessageEnvelope envelope = envelopes.get(message.getUid());
        if (envelope != null) {
            message.setNewHeaders(envelope);
            message.setFlagInternal(com.fsck.k9.mail.Flag.SEEN, envelope.getReadStatus());
        } else {
            timber.log.Timber.e("Asked to get metadata for a non-existent message: %s", message.getUid());
        }
        if (listener != null) {
            listener.messageFinished(messages.get(i), i, count);
        }
    }
}

