/**
 * A "{" has been read. Read the rest of the size string, the space and then notify the callback with an
 * {@code InputStream}.
 */
private java.lang.Object parseLiteral() throws java.io.IOException {
    expect('{');
    int size = java.lang.Integer.parseInt(readStringUntil('}'));
    expect('\r');
    expect('\n');
    if (size == 0) {
        return "";
    }
    if (response.getCallback() != null) {
        com.fsck.k9.mail.filter.FixedLengthInputStream fixed = new com.fsck.k9.mail.filter.FixedLengthInputStream(inputStream, size);
        java.lang.Exception callbackException = null;
        java.lang.Object result = null;
        try {
            result = response.getCallback().foundLiteral(response, fixed);
        } catch (java.io.IOException e) {
            throw e;
        } catch (java.lang.Exception e) {
            callbackException = e;
        }
        boolean someDataWasRead = fixed.available() != size;
        if (someDataWasRead) {
            if ((result == null) && (callbackException == null)) {
                throw new java.lang.AssertionError("Callback consumed some data but returned no result");
            }
            fixed.skipRemaining();
        }
        if (callbackException != null) {
            if (exception == null) {
                exception = callbackException;
            }
            return "EXCEPTION";
        }
        if (result != null) {
            return result;
        }
    }
    byte[] data = new byte[size];
    int read = 0;
    while (read != size) {
        int count = inputStream.read(data, read, size - read);
        if (count == (-1)) {
            throw new java.io.IOException("parseLiteral(): end of stream reached");
        }
        read += count;
    } 
    return new java.lang.String(data, "US-ASCII");
}

