public void open() throws com.fsck.k9.mail.MessagingException {
    try {
        boolean secureConnection = false;
        java.net.InetAddress[] addresses = java.net.InetAddress.getAllByName(host);
        for (int i = 0; i < addresses.length; i++) {
            try {
                java.net.SocketAddress socketAddress = new java.net.InetSocketAddress(addresses[i], port);
                if (connectionSecurity == com.fsck.k9.mail.ConnectionSecurity.SSL_TLS_REQUIRED) {
                    socket = trustedSocketFactory.createSocket(null, host, port, clientCertificateAlias);
                    socket.connect(socketAddress, com.fsck.k9.mail.Transport.SOCKET_CONNECT_TIMEOUT);
                    secureConnection = true;
                } else {
                    socket = new java.net.Socket();
                    socket.connect(socketAddress, com.fsck.k9.mail.Transport.SOCKET_CONNECT_TIMEOUT);
                }
            } catch (java.net.SocketException e) {
                if (i < (addresses.length - 1)) {
                    // there are still other addresses for that host to try
                    continue;
                }
                throw new com.fsck.k9.mail.MessagingException("Cannot connect to host", e);
            }
            break;// connection success

        }
        // RFC 1047
        socket.setSoTimeout(com.fsck.k9.mail.Transport.SOCKET_READ_TIMEOUT);
        inputStream = new com.fsck.k9.mail.filter.PeekableInputStream(new java.io.BufferedInputStream(socket.getInputStream(), 1024));
        outputStream = new java.io.BufferedOutputStream(socket.getOutputStream(), 1024);
        // Eat the banner
        executeCommand(null);
        java.net.InetAddress localAddress = socket.getLocalAddress();
        java.lang.String localHost = getCanonicalHostName(localAddress);
        java.lang.String ipAddr = localAddress.getHostAddress();
        if ((localHost.equals("") || localHost.equals(ipAddr)) || localHost.contains("_")) {
            // We don't have a FQDN or the hostname contains invalid
            // characters (see issue 2143), so use IP address.
            if (!ipAddr.equals("")) {
                if (localAddress instanceof java.net.Inet6Address) {
                    localHost = ("[IPv6:" + ipAddr) + "]";
                } else {
                    localHost = ("[" + ipAddr) + "]";
                }
            } else {
                // If the IP address is no good, set a sane default (see issue 2750).
                localHost = "android";
            }
        }
        java.util.Map<java.lang.String, java.lang.String> extensions = sendHello(localHost);
        is8bitEncodingAllowed = extensions.containsKey("8BITMIME");
        isEnhancedStatusCodesProvided = extensions.containsKey("ENHANCEDSTATUSCODES");
        isPipeliningSupported = extensions.containsKey("PIPELINING");
        if (connectionSecurity == com.fsck.k9.mail.ConnectionSecurity.STARTTLS_REQUIRED) {
            if (extensions.containsKey("STARTTLS")) {
                executeCommand("STARTTLS");
                socket = trustedSocketFactory.createSocket(socket, host, port, clientCertificateAlias);
                inputStream = new com.fsck.k9.mail.filter.PeekableInputStream(new java.io.BufferedInputStream(socket.getInputStream(), 1024));
                outputStream = new java.io.BufferedOutputStream(socket.getOutputStream(), 1024);
                /* Now resend the EHLO. Required by RFC2487 Sec. 5.2, and more specifically,
                Exim.
                 */
                extensions = sendHello(localHost);
                secureConnection = true;
            } else {
                /* This exception triggers a "Certificate error"
                notification that takes the user to the incoming
                server settings for review. This might be needed if
                the account was configured with an obsolete
                "STARTTLS (if available)" setting.
                 */
                throw new com.fsck.k9.mail.CertificateValidationException("STARTTLS connection security not available");
            }
        }
        boolean authLoginSupported = false;
        boolean authPlainSupported = false;
        boolean authCramMD5Supported = false;
        boolean authExternalSupported = false;
        boolean authXoauth2Supported = false;
        if (extensions.containsKey("AUTH")) {
            java.util.List<java.lang.String> saslMech = java.util.Arrays.asList(extensions.get("AUTH").split(" "));
            authLoginSupported = saslMech.contains("LOGIN");
            authPlainSupported = saslMech.contains("PLAIN");
            authCramMD5Supported = saslMech.contains("CRAM-MD5");
            authExternalSupported = saslMech.contains("EXTERNAL");
            authXoauth2Supported = saslMech.contains("XOAUTH2");
        }
        parseOptionalSizeValue(extensions);
        if ((!android.text.TextUtils.isEmpty(username)) && (((!android.text.TextUtils.isEmpty(password)) || (com.fsck.k9.mail.AuthType.EXTERNAL == authType)) || (com.fsck.k9.mail.AuthType.XOAUTH2 == authType))) {
            switch (authType) {
                /* LOGIN is an obsolete option which is unavailable to users,
                but it still may exist in a user's settings from a previous
                version, or it may have been imported.
                 */
                case LOGIN :
                case PLAIN :
                    // try saslAuthPlain first, because it supports UTF-8 explicitly
                    if (authPlainSupported) {
                        saslAuthPlain();
                    } else if (authLoginSupported) {
                        saslAuthLogin();
                    } else {
                        throw new com.fsck.k9.mail.MessagingException("Authentication methods SASL PLAIN and LOGIN are unavailable.");
                    }
                    break;
                case CRAM_MD5 :
                    if (authCramMD5Supported) {
                        saslAuthCramMD5();
                    } else {
                        throw new com.fsck.k9.mail.MessagingException("Authentication method CRAM-MD5 is unavailable.");
                    }
                    break;
                case XOAUTH2 :
                    if (authXoauth2Supported && (oauthTokenProvider != null)) {
                        saslXoauth2();
                    } else {
                        throw new com.fsck.k9.mail.MessagingException("Authentication method XOAUTH2 is unavailable.");
                    }
                    break;
                case EXTERNAL :
                    if (authExternalSupported) {
                        saslAuthExternal();
                    } else {
                        /* Some SMTP servers are known to provide no error
                        indication when a client certificate fails to
                        validate, other than to not offer the AUTH EXTERNAL
                        capability.

                        So, we treat it is an error to not offer AUTH
                        EXTERNAL when using client certificates. That way, the
                        user can be notified of a problem during account setup.
                         */
                        throw new com.fsck.k9.mail.CertificateValidationException(com.fsck.k9.mail.CertificateValidationException.Reason.MissingCapability);
                    }
                    break;
                    /* AUTOMATIC is an obsolete option which is unavailable to users,
                    but it still may exist in a user's settings from a previous
                    version, or it may have been imported.
                     */
                case AUTOMATIC :
                    if (secureConnection) {
                        // try saslAuthPlain first, because it supports UTF-8 explicitly
                        if (authPlainSupported) {
                            saslAuthPlain();
                        } else if (authLoginSupported) {
                            saslAuthLogin();
                        } else if (authCramMD5Supported) {
                            saslAuthCramMD5();
                        } else {
                            throw new com.fsck.k9.mail.MessagingException("No supported authentication methods available.");
                        }
                    } else if (authCramMD5Supported) {
                        saslAuthCramMD5();
                    } else {
                        /* We refuse to insecurely transmit the password
                        using the obsolete AUTOMATIC setting because of
                        the potential for a MITM attack. Affected users
                        must choose a different setting.
                         */
                        throw new com.fsck.k9.mail.MessagingException("Update your outgoing server authentication setting. AUTOMATIC auth. is unavailable.");
                    }
                    break;
                default :
                    throw new com.fsck.k9.mail.MessagingException("Unhandled authentication method found in the server settings (bug).");
            }
        }
    } catch (com.fsck.k9.mail.MessagingException e) {
        close();
        throw e;
    } catch (javax.net.ssl.SSLException e) {
        close();
        throw new com.fsck.k9.mail.CertificateValidationException(e.getMessage(), e);
    } catch (java.security.GeneralSecurityException gse) {
        close();
        throw new com.fsck.k9.mail.MessagingException("Unable to open connection to SMTP server due to security error.", gse);
    } catch (java.io.IOException ioe) {
        close();
        throw new com.fsck.k9.mail.MessagingException("Unable to open connection to SMTP server.", ioe);
    }
}

