private java.lang.String parseBareString(boolean allowBrackets) throws java.io.IOException {
    java.lang.StringBuilder sb = new java.lang.StringBuilder();
    int ch;
    while (true) {
        ch = inputStream.peek();
        if (ch == (-1)) {
            throw new java.io.IOException("parseBareString(): end of stream reached");
        }
        if ((((((((ch == '(') || (ch == ')')) || (allowBrackets && ((ch == '[') || (ch == ']')))) || (ch == '{')) || (ch == ' ')) || (ch == '"')) || ((ch >= 0x0) && (ch <= 0x1f))) || (ch == 0x7f)) {
            if (sb.length() == 0) {
                throw new java.io.IOException(java.lang.String.format("parseBareString(): (%04x %c)", ch, ch));
            }
            return sb.toString();
        } else {
            sb.append(((char) (inputStream.read())));
        }
    } 
}

