private int processUntaggedResponse(long oldMessageCount, com.fsck.k9.mail.store.imap.ImapResponse response, java.util.List<java.lang.Long> flagSyncMsgSeqs, java.util.List<java.lang.String> removeMsgUids) {
    superHandleUntaggedResponse(response);
    int messageCountDelta = 0;
    if ((response.getTag() == null) && (response.size() > 1)) {
        try {
            java.lang.Object responseType = response.get(1);
            if (com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(responseType, "FETCH")) {
                timber.log.Timber.i("Got FETCH %s", response);
                long msgSeq = response.getLong(0);
                if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                    timber.log.Timber.d("Got untagged FETCH for msgseq %d for %s", msgSeq, getLogId());
                }
                if (!flagSyncMsgSeqs.contains(msgSeq)) {
                    flagSyncMsgSeqs.add(msgSeq);
                }
            }
            if (com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(responseType, "EXPUNGE")) {
                long msgSeq = response.getLong(0);
                if (msgSeq <= oldMessageCount) {
                    messageCountDelta = -1;
                }
                if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                    timber.log.Timber.d("Got untagged EXPUNGE for msgseq %d for %s", msgSeq, getLogId());
                }
                java.util.List<java.lang.Long> newSeqs = new java.util.ArrayList<java.lang.Long>();
                java.util.Iterator<java.lang.Long> flagIter = flagSyncMsgSeqs.iterator();
                while (flagIter.hasNext()) {
                    long flagMsg = flagIter.next();
                    if (flagMsg >= msgSeq) {
                        flagIter.remove();
                        if (flagMsg > msgSeq) {
                            newSeqs.add(flagMsg);
                        }
                    }
                } 
                flagSyncMsgSeqs.addAll(newSeqs);
                java.util.List<java.lang.Long> msgSeqs = new java.util.ArrayList<java.lang.Long>(msgSeqUidMap.keySet());
                java.util.Collections.sort(msgSeqs);// Have to do comparisons in order because of msgSeq reductions

                for (long msgSeqNum : msgSeqs) {
                    if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                        timber.log.Timber.v("Comparing EXPUNGEd msgSeq %d to %d", msgSeq, msgSeqNum);
                    }
                    if (msgSeqNum == msgSeq) {
                        java.lang.String uid = msgSeqUidMap.get(msgSeqNum);
                        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                            timber.log.Timber.d("Scheduling removal of UID %s because msgSeq %d was expunged", uid, msgSeqNum);
                        }
                        removeMsgUids.add(uid);
                        msgSeqUidMap.remove(msgSeqNum);
                    } else if (msgSeqNum > msgSeq) {
                        java.lang.String uid = msgSeqUidMap.get(msgSeqNum);
                        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                            timber.log.Timber.d("Reducing msgSeq for UID %s from %d to %d", uid, msgSeqNum, msgSeqNum - 1);
                        }
                        msgSeqUidMap.remove(msgSeqNum);
                        msgSeqUidMap.put(msgSeqNum - 1, uid);
                    }
                }
            }
        } catch (java.lang.Exception e) {
            timber.log.Timber.e(e, "Could not handle untagged FETCH for %s", getLogId());
        }
    }
    return messageCountDelta;
}

