/**
 * Writes <code>len</code> bytes from the specified
 * <code>b</code> array starting at <code>offset</code> to
 * this output stream.
 *
 * @param b
 * 		source byte array
 * @param offset
 * 		where to start reading the bytes
 * @param len
 * 		maximum number of bytes to write
