private static java.lang.String decodeEncodedWord(java.lang.String body, int begin, int end, com.fsck.k9.mail.Message message) {
    int qm1 = body.indexOf('?', begin + 2);
    if (qm1 == (end - 2)) {
        return null;
    }
    int qm2 = body.indexOf('?', qm1 + 1);
    if (qm2 == (end - 2)) {
        return null;
    }
    java.lang.String mimeCharset = body.substring(begin + 2, qm1);
    java.lang.String encoding = body.substring(qm1 + 1, qm2);
    java.lang.String encodedText = body.substring(qm2 + 1, end - 2);
    java.lang.String charset;
    try {
        charset = com.fsck.k9.mail.internet.CharsetSupport.fixupCharset(mimeCharset, message);
    } catch (com.fsck.k9.mail.MessagingException e) {
        return null;
    }
    if (encodedText.isEmpty()) {
        timber.log.Timber.w("Missing encoded text in encoded word: '%s'", body.substring(begin, end));
        return null;
    }
    if (encoding.equalsIgnoreCase("Q")) {
        return com.fsck.k9.mail.internet.DecoderUtil.decodeQ(encodedText, charset);
    } else if (encoding.equalsIgnoreCase("B")) {
        return com.fsck.k9.mail.internet.DecoderUtil.decodeB(encodedText, charset);
    } else {
