public synchronized void open(int mode) throws com.fsck.k9.mail.MessagingException {
    if (isOpen()) {
        return;
    }
    if (!mName.equalsIgnoreCase(mStoreConfig.getInboxFolderName())) {
        throw new com.fsck.k9.mail.MessagingException("Folder does not exist");
    }
    try {
        java.net.SocketAddress socketAddress = new java.net.InetSocketAddress(mHost, mPort);
        if (mConnectionSecurity == com.fsck.k9.mail.ConnectionSecurity.SSL_TLS_REQUIRED) {
            mSocket = mTrustedSocketFactory.createSocket(null, mHost, mPort, mClientCertificateAlias);
        } else {
            mSocket = new java.net.Socket();
        }
        mSocket.connect(socketAddress, com.fsck.k9.mail.store.RemoteStore.SOCKET_CONNECT_TIMEOUT);
        mIn = new java.io.BufferedInputStream(mSocket.getInputStream(), 1024);
        mOut = new java.io.BufferedOutputStream(mSocket.getOutputStream(), 512);
        mSocket.setSoTimeout(com.fsck.k9.mail.store.RemoteStore.SOCKET_READ_TIMEOUT);
        if (!isOpen()) {
            throw new com.fsck.k9.mail.MessagingException("Unable to connect socket");
        }
        java.lang.String serverGreeting = executeSimpleCommand(null);
        mCapabilities = getCapabilities();
        if (mConnectionSecurity == com.fsck.k9.mail.ConnectionSecurity.STARTTLS_REQUIRED) {
            if (mCapabilities.stls) {
                executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.STLS_COMMAND);
                mSocket = mTrustedSocketFactory.createSocket(mSocket, mHost, mPort, mClientCertificateAlias);
                mSocket.setSoTimeout(com.fsck.k9.mail.store.RemoteStore.SOCKET_READ_TIMEOUT);
                mIn = new java.io.BufferedInputStream(mSocket.getInputStream(), 1024);
                mOut = new java.io.BufferedOutputStream(mSocket.getOutputStream(), 512);
                if (!isOpen()) {
                    throw new com.fsck.k9.mail.MessagingException("Unable to connect socket");
                }
                mCapabilities = getCapabilities();
            } else {
                /* This exception triggers a "Certificate error"
                notification that takes the user to the incoming
                server settings for review. This might be needed if
                the account was configured with an obsolete
                "STARTTLS (if available)" setting.
                 */
                throw new com.fsck.k9.mail.CertificateValidationException("STARTTLS connection security not available");
            }
        }
        switch (mAuthType) {
            case PLAIN :
                if (mCapabilities.authPlain) {
                    authPlain();
                } else {
                    login();
                }
                break;
            case CRAM_MD5 :
                if (mCapabilities.cramMD5) {
                    authCramMD5();
                } else {
                    authAPOP(serverGreeting);
                }
                break;
            case EXTERNAL :
                if (mCapabilities.external) {
                    authExternal();
                } else {
                    // Provide notification to user of a problem authenticating using client certificates
                    throw new com.fsck.k9.mail.CertificateValidationException(com.fsck.k9.mail.CertificateValidationException.Reason.MissingCapability);
                }
                break;
            default :
                throw new com.fsck.k9.mail.MessagingException("Unhandled authentication method found in the server settings (bug).");
        }
    } catch (javax.net.ssl.SSLException e) {
        if (e.getCause() instanceof java.security.cert.CertificateException) {
            throw new com.fsck.k9.mail.CertificateValidationException(e.getMessage(), e);
        } else {
            throw new com.fsck.k9.mail.MessagingException("Unable to connect", e);
        }
    } catch (java.security.GeneralSecurityException gse) {
        throw new com.fsck.k9.mail.MessagingException("Unable to open connection to POP server due to security error.", gse);
    } catch (java.io.IOException ioe) {
        throw new com.fsck.k9.mail.MessagingException("Unable to open connection to POP server.", ioe);
    }
    java.lang.String response = executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.STAT_COMMAND);
    java.lang.String[] parts = response.split(" ");
    mMessageCount = java.lang.Integer.parseInt(parts[1]);
    mUidToMsgMap.clear();
    mMsgNumToMsgMap.clear();
    mUidToMsgNumMap.clear();
}

