private java.lang.Object handleFetchResponse(com.fsck.k9.mail.store.imap.ImapMessage message, com.fsck.k9.mail.store.imap.ImapList fetchList) throws com.fsck.k9.mail.MessagingException {
    java.lang.Object result = null;
    if (fetchList.containsKey("FLAGS")) {
        com.fsck.k9.mail.store.imap.ImapList flags = fetchList.getKeyedList("FLAGS");
        if (flags != null) {
            for (int i = 0, count = flags.size(); i < count; i++) {
                java.lang.String flag = flags.getString(i);
                if (flag.equalsIgnoreCase("\\Deleted")) {
                    message.setFlagInternal(com.fsck.k9.mail.Flag.DELETED, true);
                } else if (flag.equalsIgnoreCase("\\Answered")) {
                    message.setFlagInternal(com.fsck.k9.mail.Flag.ANSWERED, true);
                } else if (flag.equalsIgnoreCase("\\Seen")) {
                    message.setFlagInternal(com.fsck.k9.mail.Flag.SEEN, true);
                } else if (flag.equalsIgnoreCase("\\Flagged")) {
                    message.setFlagInternal(com.fsck.k9.mail.Flag.FLAGGED, true);
                } else if (flag.equalsIgnoreCase("$Forwarded")) {
                    message.setFlagInternal(com.fsck.k9.mail.Flag.FORWARDED, true);
                    /* a message contains FORWARDED FLAG -> so we can also create them */
                    store.getPermanentFlagsIndex().add(com.fsck.k9.mail.Flag.FORWARDED);
                }
            }
        }
    }
    if (fetchList.containsKey("INTERNALDATE")) {
        java.util.Date internalDate = fetchList.getKeyedDate("INTERNALDATE");
        message.setInternalDate(internalDate);
    }
    if (fetchList.containsKey("RFC822.SIZE")) {
        int size = fetchList.getKeyedNumber("RFC822.SIZE");
        message.setSize(size);
    }
    if (fetchList.containsKey("BODYSTRUCTURE")) {
        com.fsck.k9.mail.store.imap.ImapList bs = fetchList.getKeyedList("BODYSTRUCTURE");
        if (bs != null) {
            try {
                parseBodyStructure(bs, message, "TEXT");
            } catch (com.fsck.k9.mail.MessagingException e) {
                if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                    timber.log.Timber.d(e, "Error handling message for %s", getLogId());
                }
                message.setBody(null);
            }
        }
    }
    if (fetchList.containsKey("BODY")) {
        int index = fetchList.getKeyIndex("BODY") + 2;
        int size = fetchList.size();
        if (index < size) {
            result = fetchList.getObject(index);
            // Check if there's an origin octet
            if (result instanceof java.lang.String) {
                java.lang.String originOctet = ((java.lang.String) (result));
                if (originOctet.startsWith("<") && ((index + 1) < size)) {
                    result = fetchList.getObject(index + 1);
                }
            }
        }
    }
    return result;
}

protected java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> internalOpen(int mode) throws com.fsck.k9.mail.MessagingException {
    if (isOpen() && (this.mode == mode)) {
        // Make sure the connection is valid. If it's not we'll close it down and continue
        // on to get a new one.
        try {
            return executeSimpleCommand(com.fsck.k9.mail.store.imap.Commands.NOOP);
        } catch (java.io.IOException ioe) {
            ioExceptionHandler(connection, ioe);
        }
    }
    store.releaseConnection(connection);
    synchronized(this) {
        connection = store.getConnection();
    }
    try {
        msgSeqUidMap.clear();
        java.lang.String openCommand = (mode == com.fsck.k9.mail.Folder.OPEN_MODE_RW) ? "SELECT" : "EXAMINE";
        java.lang.String encodedFolderName = folderNameCodec.encode(getPrefixedName());
        java.lang.String escapedFolderName = com.fsck.k9.mail.store.imap.ImapUtility.encodeString(encodedFolderName);
        java.lang.String command = java.lang.String.format("%s %s", openCommand, escapedFolderName);
        java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = executeSimpleCommand(command);
        /* If the command succeeds we expect the folder has been opened read-write unless we
        are notified otherwise in the responses.
         */
        this.mode = mode;
        for (com.fsck.k9.mail.store.imap.ImapResponse response : responses) {
            handlePermanentFlags(response);
        }
        handleSelectOrExamineOkResponse(com.fsck.k9.mail.store.imap.ImapUtility.getLastResponse(responses));
        exists = true;
        return responses;
    } catch (java.io.IOException ioe) {
        throw ioExceptionHandler(connection, ioe);
    } catch (com.fsck.k9.mail.MessagingException me) {
        timber.log.Timber.e(me, "Unable to open connection for %s", getLogId());
        throw me;
    }
}

