public com.fsck.k9.mail.store.webdav.WebDavHttpClient getHttpClient() throws com.fsck.k9.mail.MessagingException {
    if (httpClient == null) {
        httpClient = httpClientFactory.create();
        // Disable automatic redirects on the http client.
        httpClient.getParams().setBooleanParameter("http.protocol.handle-redirects", false);
        // Setup a cookie store for forms-based authentication.
        httpContext = new org.apache.http.protocol.BasicHttpContext();
        authCookies = new org.apache.http.impl.client.BasicCookieStore();
        httpContext.setAttribute(ClientContext.COOKIE_STORE, authCookies);
        org.apache.http.conn.scheme.SchemeRegistry reg = httpClient.getConnectionManager().getSchemeRegistry();
        try {
            org.apache.http.conn.scheme.Scheme s = new org.apache.http.conn.scheme.Scheme("https", new com.fsck.k9.mail.store.webdav.WebDavSocketFactory(hostname, 443), 443);
            reg.register(s);
