            timber.log.Timber.e(nsa, "NoSuchAlgorithmException in getHttpClient");
            throw new com.fsck.k9.mail.MessagingException("NoSuchAlgorithmException in getHttpClient: ", nsa);
        } catch (java.security.KeyManagementException kme) {
            timber.log.Timber.e(kme, "KeyManagementException in getHttpClient");
            throw new com.fsck.k9.mail.MessagingException("KeyManagementException in getHttpClient: ", kme);
        }
    }
    return httpClient;
}

