    java.lang.String dispositionFilename = null;
    if (disposition != null) {
        dispositionType = com.fsck.k9.mail.internet.MimeUtility.getHeaderParameter(disposition, null);
        dispositionFilename = com.fsck.k9.mail.internet.MimeUtility.getHeaderParameter(disposition, "filename");
    }
    boolean isAttachmentDisposition = "attachment".equalsIgnoreCase(dispositionType) || (dispositionFilename != null);
    if (isAttachmentDisposition) {
        return false;
    }
    if (part.isMimeType("text/html")) {
        return true;
    }
    if (part.isMimeType("text/plain")) {
        return true;
    }
    if (part.isMimeType("application/pgp")) {
        return true;
    }
    return false;
}

