private void fetchFlags(java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> startMessages, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.webdav.WebDavMessage> listener) throws com.fsck.k9.mail.MessagingException {
    java.util.HashMap<java.lang.String, java.lang.String> headers = new java.util.HashMap<java.lang.String, java.lang.String>();
    java.lang.String messageBody;
    java.util.List<com.fsck.k9.mail.Message> messages = new java.util.ArrayList<com.fsck.k9.mail.Message>(20);
    java.lang.String[] uids;
    if ((startMessages == null) || startMessages.isEmpty()) {
        return;
    }
    if (startMessages.size() > 20) {
        java.util.List<com.fsck.k9.mail.store.webdav.WebDavMessage> newMessages = new java.util.ArrayList<com.fsck.k9.mail.store.webdav.WebDavMessage>(startMessages.size() - 20);
        for (int i = 0, count = startMessages.size(); i < count; i++) {
            if (i < 20) {
                messages.add(startMessages.get(i));
            } else {
                newMessages.add(startMessages.get(i));
            }
        }
        fetchFlags(newMessages, listener);
    } else {
        messages.addAll(startMessages);
    }
    uids = new java.lang.String[messages.size()];
    for (int i = 0, count = messages.size(); i < count; i++) {
        uids[i] = messages.get(i).getUid();
    }
    messageBody = store.getMessageFlagsXml(uids);
    headers.put("Brief", "t");
    com.fsck.k9.mail.store.webdav.DataSet dataset = store.processRequest(this.mFolderUrl, "SEARCH", messageBody, headers);
    if (dataset == null) {
        throw new com.fsck.k9.mail.MessagingException("Data Set from request was null");
    }
    java.util.Map<java.lang.String, java.lang.Boolean> uidToReadStatus = dataset.getUidToRead();
    for (int i = 0, count = messages.size(); i < count; i++) {
        if (!(messages.get(i) instanceof com.fsck.k9.mail.store.webdav.WebDavMessage)) {
            throw new com.fsck.k9.mail.MessagingException("WebDavStore fetch called with non-WebDavMessage");
        }
        com.fsck.k9.mail.store.webdav.WebDavMessage wdMessage = ((com.fsck.k9.mail.store.webdav.WebDavMessage) (messages.get(i)));
        try {
            wdMessage.setFlagInternal(com.fsck.k9.mail.Flag.SEEN, uidToReadStatus.get(wdMessage.getUid()));
        } catch (java.lang.NullPointerException e) {
            timber.log.Timber.v(e, "Under some weird circumstances, " + "setting the read status when syncing from webdav threw an NPE. Skipping.");
        }
    }
}

