private Address(java.lang.String address, java.lang.String personal, boolean parse) {
    if (parse) {
        android.text.util.Rfc822Token[] tokens = android.text.util.Rfc822Tokenizer.tokenize(address);
        if (tokens.length > 0) {
            android.text.util.Rfc822Token token = tokens[0];
            mAddress = token.getAddress();
            java.lang.String name = token.getName();
            if (!android.text.TextUtils.isEmpty(name)) {
                /* Don't use the "personal" argument if "address" is of the form:
                James Bond <james.bond@mi6.uk>

                See issue 2920
                 */
                mPersonal = name;
            } else {
                mPersonal = (personal == null) ? null : personal.trim();
            }
        } else {
            // This should be an error
        }
    } else {
        mAddress = address;
        mPersonal = personal;
    }
}

