public void delete(java.util.List<? extends com.fsck.k9.mail.Message> messages, java.lang.String trashFolderName) throws com.fsck.k9.mail.MessagingException {
    if (messages.isEmpty()) {
        return;
    }
    if ((trashFolderName == null) || getName().equalsIgnoreCase(trashFolderName)) {
        setFlags(messages, java.util.Collections.singleton(com.fsck.k9.mail.Flag.DELETED), true);
    } else {
        com.fsck.k9.mail.store.imap.ImapFolder remoteTrashFolder = getStore().getFolder(trashFolderName);
        java.lang.String encodedTrashFolderName = folderNameCodec.encode(remoteTrashFolder.getPrefixedName());
        java.lang.String escapedTrashFolderName = com.fsck.k9.mail.store.imap.ImapUtility.encodeString(encodedTrashFolderName);
        if (!exists(escapedTrashFolderName)) {
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.i("IMAPMessage.delete: attempting to create remote '%s' folder for %s", trashFolderName, getLogId());
            }
