        }
        if (exists(escapedTrashFolderName)) {
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.d("IMAPMessage.delete: copying remote %d messages to '%s' for %s", messages.size(), trashFolderName, getLogId());
