/**
 * Search the children of a {@link Multipart} for {@code text/html} parts.
 * Every part that is not a {@code text/html} we want to display, we add to 'attachments'.
 *
 * @param multipart
 * 		The {@code Multipart} to search through.
 * @param knownTextParts
 * 		A set of {@code text/plain} parts that shouldn't be added to 'attachments'.
 * @param outputNonViewableParts
 * 		A list that will receive the parts that are considered attachments.
 * @param directChild
 * 		If {@code true}, this method will add all {@code text/html} parts except the first
 * 		found to 'attachments'.
 * @return A list of {@link Text} viewables.
 * @throws MessagingException
 * 		In case of an error.
 */
private static java.util.List<com.fsck.k9.mail.internet.Viewable> findHtmlPart(com.fsck.k9.mail.Multipart multipart, java.util.Set<com.fsck.k9.mail.Part> knownTextParts, @android.support.annotation.Nullable
java.util.List<com.fsck.k9.mail.Part> outputNonViewableParts, boolean directChild) throws com.fsck.k9.mail.MessagingException {
    boolean saveNonViewableParts = outputNonViewableParts != null;
    java.util.List<com.fsck.k9.mail.internet.Viewable> viewables = new java.util.ArrayList<>();
    boolean partFound = false;
    for (com.fsck.k9.mail.Part part : multipart.getBodyParts()) {
        com.fsck.k9.mail.Body body = part.getBody();
        if (body instanceof com.fsck.k9.mail.Multipart) {
            com.fsck.k9.mail.Multipart innerMultipart = ((com.fsck.k9.mail.Multipart) (body));
            if (directChild && partFound) {
                if (saveNonViewableParts) {
                    // We already found our text/html part. Now we're only looking for attachments.
                    com.fsck.k9.mail.internet.MessageExtractor.findAttachments(innerMultipart, knownTextParts, outputNonViewableParts);
                }
            } else {
                /* Recurse to find HTML parts. Since this is a multipart that is a child of a
                multipart/alternative we don't want to stop after the first text/html part
                we find. This will allow to get all text parts for constructions like this:

                1. multipart/alternative
                1.1. text/plain
                1.2. multipart/mixed
                1.2.1. text/html
                1.2.2. text/html
                1.3. image/jpeg
                 */
                java.util.List<com.fsck.k9.mail.internet.Viewable> htmlViewables = com.fsck.k9.mail.internet.MessageExtractor.findHtmlPart(innerMultipart, knownTextParts, outputNonViewableParts, false);
                if (!htmlViewables.isEmpty()) {
                    partFound = true;
                    viewables.addAll(htmlViewables);
                }
            }
        } else if (((!(directChild && partFound)) && com.fsck.k9.mail.internet.MessageExtractor.isPartTextualBody(part)) && com.fsck.k9.mail.internet.MimeUtility.isSameMimeType(part.getMimeType(), "text/html")) {
            com.fsck.k9.mail.internet.Viewable.Html html = new com.fsck.k9.mail.internet.Viewable.Html(part);
            viewables.add(html);
            partFound = true;
        } else if (!knownTextParts.contains(part)) {
            if (saveNonViewableParts) {
                // Only add this part as attachment if it's not a viewable text/plain part found earlier
                outputNonViewableParts.add(part);
            }
        }
    }
    return viewables;
}

