private static com.fsck.k9.mail.internet.EncoderUtil.Encoding determineEncoding(byte[] bytes) {
    if (bytes.length == 0) {
        return com.fsck.k9.mail.internet.EncoderUtil.Encoding.Q;
    }
    int qEncoded = 0;
    for (int i = 0; i < bytes.length; i++) {
        int v = bytes[i] & 0xff;
        if ((v != 32) && (!com.fsck.k9.mail.internet.EncoderUtil.Q_RESTRICTED_CHARS.get(v))) {
            qEncoded++;
        }
    }
    int percentage = (qEncoded * 100) / bytes.length;
    return percentage > 30 ? com.fsck.k9.mail.internet.EncoderUtil.Encoding.B : com.fsck.k9.mail.internet.EncoderUtil.Encoding.Q;
}

