public void fetch(java.util.List<com.fsck.k9.mail.store.imap.ImapMessage> messages, com.fsck.k9.mail.FetchProfile fetchProfile, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.store.imap.ImapMessage> listener) throws com.fsck.k9.mail.MessagingException {
    if ((messages == null) || messages.isEmpty()) {
        return;
    }
    checkOpen();
    java.util.List<java.lang.String> uids = new java.util.ArrayList<>(messages.size());
    java.util.HashMap<java.lang.String, com.fsck.k9.mail.Message> messageMap = new java.util.HashMap<>();
    for (com.fsck.k9.mail.Message message : messages) {
        java.lang.String uid = message.getUid();
        uids.add(uid);
        messageMap.put(uid, message);
    }
    java.util.Set<java.lang.String> fetchFields = new java.util.LinkedHashSet<>();
    fetchFields.add("UID");
    if (fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.FLAGS)) {
        fetchFields.add("FLAGS");
    }
    if (fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.ENVELOPE)) {
        fetchFields.add("INTERNALDATE");
        fetchFields.add("RFC822.SIZE");
        fetchFields.add((("BODY.PEEK[HEADER.FIELDS (date subject from content-type to cc " + "reply-to message-id references in-reply-to ") + com.fsck.k9.mail.K9MailLib.IDENTITY_HEADER) + ")]");
    }
    if (fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.STRUCTURE)) {
        fetchFields.add("BODYSTRUCTURE");
    }
    if (fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.BODY_SANE)) {
        int maximumAutoDownloadMessageSize = store.getStoreConfig().getMaximumAutoDownloadMessageSize();
        if (maximumAutoDownloadMessageSize > 0) {
            fetchFields.add(java.lang.String.format(java.util.Locale.US, "BODY.PEEK[]<0.%d>", maximumAutoDownloadMessageSize));
        } else {
            fetchFields.add("BODY.PEEK[]");
        }
    }
    if (fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.BODY)) {
        fetchFields.add("BODY.PEEK[]");
    }
    java.lang.String spaceSeparatedFetchFields = com.fsck.k9.mail.store.imap.ImapFolder.combine(fetchFields.toArray(new java.lang.String[fetchFields.size()]), ' ');
    for (int windowStart = 0; windowStart < messages.size(); windowStart += com.fsck.k9.mail.store.imap.ImapFolder.FETCH_WINDOW_SIZE) {
        int windowEnd = java.lang.Math.min(windowStart + com.fsck.k9.mail.store.imap.ImapFolder.FETCH_WINDOW_SIZE, messages.size());
        java.util.List<java.lang.String> uidWindow = uids.subList(windowStart, windowEnd);
        try {
            java.lang.String commaSeparatedUids = com.fsck.k9.mail.store.imap.ImapFolder.combine(uidWindow.toArray(new java.lang.String[uidWindow.size()]), ',');
            java.lang.String command = java.lang.String.format("UID FETCH %s (%s)", commaSeparatedUids, spaceSeparatedFetchFields);
            connection.sendCommand(command, false);
            com.fsck.k9.mail.store.imap.ImapResponse response;
            int messageNumber = 0;
            com.fsck.k9.mail.store.imap.ImapResponseCallback callback = null;
            if (fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.BODY) || fetchProfile.contains(com.fsck.k9.mail.FetchProfile.Item.BODY_SANE)) {
                callback = new com.fsck.k9.mail.store.imap.FetchBodyCallback(messageMap);
            }
            do {
                response = connection.readResponse(callback);
                if ((response.getTag() == null) && com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(1), "FETCH")) {
                    com.fsck.k9.mail.store.imap.ImapList fetchList = ((com.fsck.k9.mail.store.imap.ImapList) (response.getKeyedValue("FETCH")));
                    java.lang.String uid = fetchList.getKeyedString("UID");
                    long msgSeq = response.getLong(0);
                    if (uid != null) {
                        try {
                            msgSeqUidMap.put(msgSeq, uid);
                            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                                timber.log.Timber.v("Stored uid '%s' for msgSeq %d into map", uid, msgSeq);
                            }
                        } catch (java.lang.Exception e) {
                            timber.log.Timber.e("Unable to store uid '%s' for msgSeq %d", uid, msgSeq);
                        }
                    }
                    com.fsck.k9.mail.Message message = messageMap.get(uid);
                    if (message == null) {
                        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                            timber.log.Timber.d("Do not have message in messageMap for UID %s for %s", uid, getLogId());
                        }
                        handleUntaggedResponse(response);
                        continue;
                    }
                    if (listener != null) {
                        listener.messageStarted(uid, messageNumber++, messageMap.size());
                    }
                    com.fsck.k9.mail.store.imap.ImapMessage imapMessage = ((com.fsck.k9.mail.store.imap.ImapMessage) (message));
                    java.lang.Object literal = handleFetchResponse(imapMessage, fetchList);
                    if (literal != null) {
                        if (literal instanceof java.lang.String) {
                            java.lang.String bodyString = ((java.lang.String) (literal));
                            java.io.InputStream bodyStream = new java.io.ByteArrayInputStream(bodyString.getBytes());
                            imapMessage.parse(bodyStream);
                        } else if (literal instanceof java.lang.Integer) {
                            // All the work was done in FetchBodyCallback.foundLiteral()
                        } else {
                            // This shouldn't happen
                            throw new com.fsck.k9.mail.MessagingException("Got FETCH response with bogus parameters");
                        }
                    }
                    if (listener != null) {
                        listener.messageFinished(imapMessage, messageNumber, messageMap.size());
                    }
                } else {
                    handleUntaggedResponse(response);
                }
            } while (response.getTag() == null );
        } catch (java.io.IOException ioe) {
            throw ioExceptionHandler(connection, ioe);
        }
    }
}

