void encode(byte[] in, int inPos, int inAvail) {
    if (eof) {
        return;
    }
    // inAvail < 0 is how we're informed of EOF in the underlying data we're
    // encoding.
    if (inAvail < 0) {
        eof = true;
        if ((buf == null) || ((buf.length - pos) < encodeSize)) {
            resizeBuf();
        }
        switch (modulus) {
            case 1 :
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x >> 2) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x << 4) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.PAD;
                buf[pos++] = com.fsck.k9.mail.filter.Base64.PAD;
                break;
            case 2 :
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x >> 10) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x >> 4) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x << 2) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.PAD;
                break;
        }
        if (lineLength > 0) {
            java.lang.System.arraycopy(lineSeparator, 0, buf, pos, lineSeparator.length);
            pos += lineSeparator.length;
        }
    } else {
        for (int i = 0; i < inAvail; i++) {
            if ((buf == null) || ((buf.length - pos) < encodeSize)) {
                resizeBuf();
            }
            modulus = (++modulus) % 3;
            int b = in[inPos++];
            if (b < 0) {
                b += 256;
            }
            x = (x << 8) + b;
            if (0 == modulus) {
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x >> 18) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x >> 12) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[(x >> 6) & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                buf[pos++] = com.fsck.k9.mail.filter.Base64.intToBase64[x & com.fsck.k9.mail.filter.Base64.MASK_6BITS];
                currentLinePos += 4;
                if ((lineLength > 0) && (lineLength <= currentLinePos)) {
                    java.lang.System.arraycopy(lineSeparator, 0, buf, pos, lineSeparator.length);
                    pos += lineSeparator.length;
                    currentLinePos = 0;
                }
            }
        }
    }
}

