static java.lang.String readToString(java.io.InputStream in, java.lang.String charset) throws java.io.IOException {
    boolean isIphoneString = false;
    // iso-2022-jp variants are supported by no versions as of Dec 2010.
    if ((((charset.length() > 19) && charset.startsWith("x-")) && charset.endsWith("-iso-2022-jp-2007")) && (!java.nio.charset.Charset.isSupported(charset))) {
        in = new com.fsck.k9.mail.internet.Iso2022JpToShiftJisInputStream(in);
        charset = ("x-" + charset.substring(2, charset.length() - 17)) + "-shift_jis-2007";
    }
    // shift_jis variants are supported by Eclair and later.
    if (com.fsck.k9.mail.internet.JisSupport.isShiftJis(charset) && (!java.nio.charset.Charset.isSupported(charset))) {
        // If the JIS variant is iPhone, map the Unicode private use area in iPhone to the one in Android after
        // converting the character set from the standard Shift JIS to Unicode.
        if (charset.substring(2, charset.length() - 15).equals("iphone")) {
            isIphoneString = true;
        }
        charset = com.fsck.k9.mail.internet.JisSupport.SHIFT_JIS;
    }
    /* See if there is conversion from the MIME charset to the Java one.
    this function may also throw an exception if the charset name is not known
     */
    boolean supported;
    try {
        supported = java.nio.charset.Charset.isSupported(charset);
    } catch (java.nio.charset.IllegalCharsetNameException e) {
        supported = false;
    }
    for (java.lang.String[] rule : com.fsck.k9.mail.internet.CharsetSupport.CHARSET_FALLBACK_MAP) {
        if (supported) {
            break;
        }
        if (charset.matches(rule[0])) {
            timber.log.Timber.e("I don't know how to deal with the charset %s. Falling back to %s", charset, rule[1]);
            charset = rule[1];
            try {
                supported = java.nio.charset.Charset.isSupported(charset);
            } catch (java.nio.charset.IllegalCharsetNameException e) {
                supported = false;
            }
        }
    }
    /* Convert and return as new String */
    java.lang.String str = org.apache.commons.io.IOUtils.toString(in, charset);
    if (isIphoneString) {
        str = com.fsck.k9.mail.internet.CharsetSupport.importStringFromIphone(str);
    }
    return str;
}

