/**
 * Decodes a SmtpTransport URI.
 *
 * NOTE: In contrast to ImapStore and Pop3Store, the authType is appended at the end!
 *
 * <p>Possible forms:</p>
 * <pre>
 * smtp://user:password:auth@server:port ConnectionSecurity.NONE
 * smtp+tls+://user:password:auth@server:port ConnectionSecurity.STARTTLS_REQUIRED
 * smtp+ssl+://user:password:auth@server:port ConnectionSecurity.SSL_TLS_REQUIRED
 * </pre>
 */
private static com.fsck.k9.mail.ServerSettings decodeSmtpUri(java.lang.String uri) {
    java.lang.String host;
    int port;
    com.fsck.k9.mail.ConnectionSecurity connectionSecurity;
    com.fsck.k9.mail.AuthType authType = null;
    java.lang.String username = null;
    java.lang.String password = null;
    java.lang.String clientCertificateAlias = null;
    java.net.URI smtpUri;
    try {
        smtpUri = new java.net.URI(uri);
    } catch (java.net.URISyntaxException use) {
        throw new java.lang.IllegalArgumentException("Invalid SmtpTransport URI", use);
    }
    java.lang.String scheme = smtpUri.getScheme();
    /* Currently available schemes are:
    smtp
    smtp+tls+
    smtp+ssl+

    The following are obsolete schemes that may be found in pre-existing
    settings from earlier versions or that may be found when imported. We
    continue to recognize them and re-map them appropriately:
    smtp+tls
    smtp+ssl
     */
    if (scheme.equals("smtp")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.NONE;
        port = com.fsck.k9.mail.ServerSettings.Type.SMTP.defaultPort;
    } else if (scheme.startsWith("smtp+tls")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.STARTTLS_REQUIRED;
        port = com.fsck.k9.mail.ServerSettings.Type.SMTP.defaultPort;
    } else if (scheme.startsWith("smtp+ssl")) {
        connectionSecurity = com.fsck.k9.mail.ConnectionSecurity.SSL_TLS_REQUIRED;
        port = com.fsck.k9.mail.ServerSettings.Type.SMTP.defaultTlsPort;
    } else {
        throw new java.lang.IllegalArgumentException(("Unsupported protocol (" + scheme) + ")");
    }
    host = smtpUri.getHost();
    if (smtpUri.getPort() != (-1)) {
        port = smtpUri.getPort();
    }
    if (smtpUri.getUserInfo() != null) {
        java.lang.String[] userInfoParts = smtpUri.getUserInfo().split(":");
        if (userInfoParts.length == 1) {
            authType = com.fsck.k9.mail.AuthType.PLAIN;
            username = com.fsck.k9.mail.TransportUris.decodeUtf8(userInfoParts[0]);
        } else if (userInfoParts.length == 2) {
            authType = com.fsck.k9.mail.AuthType.PLAIN;
            username = com.fsck.k9.mail.TransportUris.decodeUtf8(userInfoParts[0]);
            password = com.fsck.k9.mail.TransportUris.decodeUtf8(userInfoParts[1]);
        } else if (userInfoParts.length == 3) {
            // NOTE: In SmtpTransport URIs, the authType comes last!
            authType = com.fsck.k9.mail.AuthType.valueOf(userInfoParts[2]);
            username = com.fsck.k9.mail.TransportUris.decodeUtf8(userInfoParts[0]);
            if (authType == com.fsck.k9.mail.AuthType.EXTERNAL) {
                clientCertificateAlias = com.fsck.k9.mail.TransportUris.decodeUtf8(userInfoParts[1]);
            } else {
                password = com.fsck.k9.mail.TransportUris.decodeUtf8(userInfoParts[1]);
            }
        }
    }
    return new com.fsck.k9.mail.ServerSettings(com.fsck.k9.mail.ServerSettings.Type.SMTP, host, port, connectionSecurity, authType, username, password, clientCertificateAlias);
}

