 * encoded words if it does not fit in a single one.
 *
 * @param text
 * 		text to encode.
 * @param charset
 * 		the Java charset that should be used to encode the specified
 * 		string into a byte array. A suitable charset is detected
 * 		automatically if this parameter is <code>null</code>.
 * @return the encoded word (or sequence of encoded words if the given text
does not fit in a single encoded word).
 */
public static java.lang.String encodeEncodedWord(java.lang.String text, java.nio.charset.Charset charset) {
    if (text == null) {
        throw new java.lang.IllegalArgumentException();
    }
    if (charset == null) {
        charset = com.fsck.k9.mail.internet.EncoderUtil.determineCharset(text);
    }
    java.lang.String mimeCharset = com.fsck.k9.mail.internet.CharsetSupport.getExternalCharset(charset.name());
    byte[] bytes = com.fsck.k9.mail.internet.EncoderUtil.encode(text, charset);
    com.fsck.k9.mail.internet.EncoderUtil.Encoding encoding = com.fsck.k9.mail.internet.EncoderUtil.determineEncoding(bytes);
    if (encoding == com.fsck.k9.mail.internet.EncoderUtil.Encoding.B) {
        java.lang.String prefix = (com.fsck.k9.mail.internet.EncoderUtil.ENC_WORD_PREFIX + mimeCharset) + "?B?";
        return com.fsck.k9.mail.internet.EncoderUtil.encodeB(prefix, text, charset, bytes);
    } else {
        java.lang.String prefix = (com.fsck.k9.mail.internet.EncoderUtil.ENC_WORD_PREFIX + mimeCharset) + "?Q?";
        return com.fsck.k9.mail.internet.EncoderUtil.encodeQ(prefix, text, charset, bytes);
    }
