private void sendMessageTo(java.util.List<java.lang.String> addresses, com.fsck.k9.mail.Message message) throws com.fsck.k9.mail.MessagingException {
    close();
    open();
    // If the message has attachments and our server has told us about a limit on
    // the size of messages, count the message's size before sending it
    if ((largestAcceptableMessage > 0) && message.hasAttachments()) {
        if (message.calculateSize() > largestAcceptableMessage) {
            throw new com.fsck.k9.mail.MessagingException("Message too large for server", true);
        }
    }
    boolean entireMessageSent = false;
    try {
        java.lang.String mailFrom = com.fsck.k9.mail.transport.smtp.SmtpTransport.constructSmtpMailFromCommand(message.getFrom(), is8bitEncodingAllowed);
        if (isPipeliningSupported) {
            java.util.Queue<java.lang.String> pipelinedCommands = new java.util.LinkedList<>();
            pipelinedCommands.add(mailFrom);
            for (java.lang.String address : addresses) {
                pipelinedCommands.add(java.lang.String.format("RCPT TO:<%s>", address));
            }
            pipelinedCommands.add("DATA");
            executePipelinedCommands(pipelinedCommands);
            readPipelinedResponse(pipelinedCommands);
        } else {
            executeCommand(mailFrom);
            for (java.lang.String address : addresses) {
                executeCommand("RCPT TO:<%s>", address);
            }
            executeCommand("DATA");
        }
        com.fsck.k9.mail.filter.EOLConvertingOutputStream msgOut = new com.fsck.k9.mail.filter.EOLConvertingOutputStream(new com.fsck.k9.mail.filter.LineWrapOutputStream(new com.fsck.k9.mail.filter.SmtpDataStuffing(outputStream), 1000));
        message.writeTo(msgOut);
        msgOut.endWithCrLfAndFlush();
        entireMessageSent = true;// After the "\r\n." is attempted, we may have sent the message

        executeCommand(".");
    } catch (com.fsck.k9.mail.transport.smtp.NegativeSmtpReplyException e) {
        throw e;
    } catch (java.lang.Exception e) {
        com.fsck.k9.mail.MessagingException me = new com.fsck.k9.mail.MessagingException("Unable to send message", e);
        me.setPermanentFailure(entireMessageSent);
        throw me;
    } finally {
        close();
    }
}

