    }
    messageBody = store.getMoveOrCopyMessagesReadXml(urls, isMove);
    com.fsck.k9.mail.store.webdav.WebDavFolder destFolder = store.getFolder(folderName);
    headers.put("Destination", destFolder.mFolderUrl);
