public void fetchPart(com.fsck.k9.mail.Message message, com.fsck.k9.mail.Part part, com.fsck.k9.mail.MessageRetrievalListener<com.fsck.k9.mail.Message> listener, com.fsck.k9.mail.BodyFactory bodyFactory) throws com.fsck.k9.mail.MessagingException {
    checkOpen();
    java.lang.String partId = part.getServerExtra();
    java.lang.String fetch;
    if ("TEXT".equalsIgnoreCase(partId)) {
        int maximumAutoDownloadMessageSize = store.getStoreConfig().getMaximumAutoDownloadMessageSize();
        fetch = java.lang.String.format(java.util.Locale.US, "BODY.PEEK[TEXT]<0.%d>", maximumAutoDownloadMessageSize);
    } else {
        fetch = java.lang.String.format("BODY.PEEK[%s]", partId);
    }
    try {
        java.lang.String command = java.lang.String.format("UID FETCH %s (UID %s)", message.getUid(), fetch);
        connection.sendCommand(command, false);
        com.fsck.k9.mail.store.imap.ImapResponse response;
        int messageNumber = 0;
        com.fsck.k9.mail.store.imap.ImapResponseCallback callback = new com.fsck.k9.mail.store.imap.FetchPartCallback(part, bodyFactory);
        do {
            response = connection.readResponse(callback);
            if ((response.getTag() == null) && com.fsck.k9.mail.store.imap.ImapResponseParser.equalsIgnoreCase(response.get(1), "FETCH")) {
                com.fsck.k9.mail.store.imap.ImapList fetchList = ((com.fsck.k9.mail.store.imap.ImapList) (response.getKeyedValue("FETCH")));
                java.lang.String uid = fetchList.getKeyedString("UID");
                if (!message.getUid().equals(uid)) {
                    if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                        timber.log.Timber.d("Did not ask for UID %s for %s", uid, getLogId());
                    }
                    handleUntaggedResponse(response);
                    continue;
                }
                if (listener != null) {
                    listener.messageStarted(uid, messageNumber++, 1);
                }
                com.fsck.k9.mail.store.imap.ImapMessage imapMessage = ((com.fsck.k9.mail.store.imap.ImapMessage) (message));
                java.lang.Object literal = handleFetchResponse(imapMessage, fetchList);
                if (literal != null) {
                    if (literal instanceof com.fsck.k9.mail.Body) {
                        // Most of the work was done in FetchAttachmentCallback.foundLiteral()
                        com.fsck.k9.mail.internet.MimeMessageHelper.setBody(part, ((com.fsck.k9.mail.Body) (literal)));
                    } else if (literal instanceof java.lang.String) {
                        java.lang.String bodyString = ((java.lang.String) (literal));
                        java.io.InputStream bodyStream = new java.io.ByteArrayInputStream(bodyString.getBytes());
                        java.lang.String contentTransferEncoding = part.getHeader(com.fsck.k9.mail.internet.MimeHeader.HEADER_CONTENT_TRANSFER_ENCODING)[0];
                        java.lang.String contentType = part.getHeader(com.fsck.k9.mail.internet.MimeHeader.HEADER_CONTENT_TYPE)[0];
                        com.fsck.k9.mail.Body body = bodyFactory.createBody(contentTransferEncoding, contentType, bodyStream);
                        com.fsck.k9.mail.internet.MimeMessageHelper.setBody(part, body);
                    } else {
                        // This shouldn't happen
                        throw new com.fsck.k9.mail.MessagingException("Got FETCH response with bogus parameters");
                    }
                }
                if (listener != null) {
                    listener.messageFinished(message, messageNumber, 1);
                }
            } else {
                handleUntaggedResponse(response);
            }
        } while (response.getTag() == null );
    } catch (java.io.IOException ioe) {
        throw ioExceptionHandler(connection, ioe);
    }
}

