private com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Capabilities getCapabilities() throws java.io.IOException {
    com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Capabilities capabilities = new com.fsck.k9.mail.store.pop3.Pop3Store.Pop3Capabilities();
    try {
        /* Try sending an AUTH command with no arguments.

        The server may respond with a list of supported SASL
        authentication mechanisms.

        Ref.: http://tools.ietf.org/html/draft-myers-sasl-pop3-05

        While this never became a standard, there are servers that
        support it, and Thunderbird includes this check.
         */
        java.lang.String response = executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.AUTH_COMMAND);
        while ((response = readLine()) != null) {
            if (response.equals(".")) {
                break;
            }
            response = response.toUpperCase(java.util.Locale.US);
            if (response.equals(com.fsck.k9.mail.store.pop3.Pop3Store.AUTH_PLAIN_CAPABILITY)) {
                capabilities.authPlain = true;
            } else if (response.equals(com.fsck.k9.mail.store.pop3.Pop3Store.AUTH_CRAM_MD5_CAPABILITY)) {
                capabilities.cramMD5 = true;
            } else if (response.equals(com.fsck.k9.mail.store.pop3.Pop3Store.AUTH_EXTERNAL_CAPABILITY)) {
                capabilities.external = true;
            }
        } 
    } catch (com.fsck.k9.mail.MessagingException e) {
        // Assume AUTH command with no arguments is not supported.
    }
    try {
        java.lang.String response = executeSimpleCommand(com.fsck.k9.mail.store.pop3.Pop3Store.CAPA_COMMAND);
        while ((response = readLine()) != null) {
            if (response.equals(".")) {
                break;
            }
            response = response.toUpperCase(java.util.Locale.US);
            if (response.equals(com.fsck.k9.mail.store.pop3.Pop3Store.STLS_CAPABILITY)) {
                capabilities.stls = true;
            } else if (response.equals(com.fsck.k9.mail.store.pop3.Pop3Store.UIDL_CAPABILITY)) {
                capabilities.uidl = true;
            } else if (response.equals(com.fsck.k9.mail.store.pop3.Pop3Store.TOP_CAPABILITY)) {
                capabilities.top = true;
            } else if (response.startsWith(com.fsck.k9.mail.store.pop3.Pop3Store.SASL_CAPABILITY)) {
                java.util.List<java.lang.String> saslAuthMechanisms = java.util.Arrays.asList(response.split(" "));
                if (saslAuthMechanisms.contains(com.fsck.k9.mail.store.pop3.Pop3Store.AUTH_PLAIN_CAPABILITY)) {
                    capabilities.authPlain = true;
                }
                if (saslAuthMechanisms.contains(com.fsck.k9.mail.store.pop3.Pop3Store.AUTH_CRAM_MD5_CAPABILITY)) {
                    capabilities.cramMD5 = true;
                }
            }
        } 
        if (!capabilities.top) {
            /* If the CAPA command is supported but it doesn't advertise support for the
            TOP command, we won't check for it manually.
             */
            mTopNotSupported = true;
        }
    } catch (com.fsck.k9.mail.MessagingException me) {
        /* The server may not support the CAPA command, so we just eat this Exception
        and allow the empty capabilities object to be returned.
         */
    }
    return capabilities;
}

