private java.util.Set<java.lang.String> listFolders(com.fsck.k9.mail.store.imap.ImapConnection connection, boolean subscribedOnly) throws java.io.IOException, com.fsck.k9.mail.MessagingException {
    java.lang.String commandResponse = (subscribedOnly) ? "LSUB" : "LIST";
    java.util.List<com.fsck.k9.mail.store.imap.ImapResponse> responses = connection.executeSimpleCommand(java.lang.String.format("%s \"\" %s", commandResponse, com.fsck.k9.mail.store.imap.ImapUtility.encodeString(getCombinedPrefix() + "*")));
    java.util.List<com.fsck.k9.mail.store.imap.ListResponse> listResponses = (subscribedOnly) ? com.fsck.k9.mail.store.imap.ListResponse.parseLsub(responses) : com.fsck.k9.mail.store.imap.ListResponse.parseList(responses);
    java.util.Set<java.lang.String> folderNames = new java.util.HashSet<>(listResponses.size());
    for (com.fsck.k9.mail.store.imap.ListResponse listResponse : listResponses) {
        boolean includeFolder = true;
        java.lang.String decodedFolderName;
        try {
            decodedFolderName = folderNameCodec.decode(listResponse.getName());
        } catch (java.nio.charset.CharacterCodingException e) {
            timber.log.Timber.w(e, "Folder name not correctly encoded with the UTF-7 variant  as defined by RFC 3501: %s", listResponse.getName());
            // TODO: Use the raw name returned by the server for all commands that require
            // a folder name. Use the decoded name only for showing it to the user.
            // We currently just skip folders with malformed names.
            continue;
        }
        java.lang.String folder = decodedFolderName;
        if (pathDelimiter == null) {
            pathDelimiter = listResponse.getHierarchyDelimiter();
            combinedPrefix = null;
        }
        if (folder.equalsIgnoreCase(mStoreConfig.getInboxFolderName())) {
            continue;
        } else if (folder.equals(mStoreConfig.getOutboxFolderName())) {
            /* There is a folder on the server with the same name as our local
            outbox. Until we have a good plan to deal with this situation
            we simply ignore the folder on the server.
             */
            continue;
        } else {
            int prefixLength = getCombinedPrefix().length();
            if (prefixLength > 0) {
                // Strip prefix from the folder name
                if (folder.length() >= prefixLength) {
                    folder = folder.substring(prefixLength);
                }
                if (!decodedFolderName.equalsIgnoreCase(getCombinedPrefix() + folder)) {
                    includeFolder = false;
                }
            }
        }
        if (listResponse.hasAttribute("\\NoSelect")) {
            includeFolder = false;
        }
        if (includeFolder) {
            folderNames.add(folder);
        }
    }
    folderNames.add(mStoreConfig.getInboxFolderName());
    return folderNames;
}

