@java.lang.Override
public void run() {
    wakeLock.acquire(com.fsck.k9.mail.K9MailLib.PUSH_WAKE_LOCK_TIMEOUT);
    if (com.fsck.k9.mail.K9MailLib.isDebug()) {
        timber.log.Timber.i("Pusher starting for %s", getLogId());
    }
    long lastUidNext = -1L;
    while (!stop) {
        try {
            long oldUidNext = getOldUidNext();
            /* This makes sure 'oldUidNext' is never smaller than 'UIDNEXT' from
            the last loop iteration. This way we avoid looping endlessly causing
            the battery to drain.

            See issue 4907
             */
            if (oldUidNext < lastUidNext) {
                oldUidNext = lastUidNext;
            }
            boolean openedNewConnection = openConnectionIfNecessary();
            if (stop) {
                break;
            }
            boolean pushPollOnConnect = store.getStoreConfig().isPushPollOnConnect();
            if (pushPollOnConnect && (openedNewConnection || needsPoll)) {
                needsPoll = false;
                syncFolderOnConnect();
            }
            if (stop) {
                break;
            }
            long newUidNext = getNewUidNext();
            lastUidNext = newUidNext;
            long startUid = getStartUid(oldUidNext, newUidNext);
            if (newUidNext > startUid) {
                notifyMessagesArrived(startUid, newUidNext);
            } else {
                processStoredUntaggedResponses();
                if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                    timber.log.Timber.i("About to IDLE for %s", getLogId());
                }
                prepareForIdle();
                com.fsck.k9.mail.store.imap.ImapConnection conn = connection;
                setReadTimeoutForIdle(conn);
                sendIdle(conn);
                returnFromIdle();
            }
        } catch (com.fsck.k9.mail.AuthenticationFailedException e) {
            reacquireWakeLockAndCleanUp();
            if (com.fsck.k9.mail.K9MailLib.isDebug()) {
                timber.log.Timber.e(e, "Authentication failed. Stopping ImapFolderPusher.");
            }
            pushReceiver.authenticationFailed();
            stop = true;
        } catch (java.lang.Exception e) {
            reacquireWakeLockAndCleanUp();
            if (stop) {
                timber.log.Timber.i("Got exception while idling, but stop is set for %s", getLogId());
            } else {
                pushReceiver.pushError("Push error for " + getName(), e);
                timber.log.Timber.e("Got exception while idling for %s", getLogId());
                pushReceiver.sleep(wakeLock, delayTime);
                delayTime *= 2;
                if (delayTime > com.fsck.k9.mail.store.imap.ImapFolderPusher.MAX_DELAY_TIME) {
                    delayTime = com.fsck.k9.mail.store.imap.ImapFolderPusher.MAX_DELAY_TIME;
                }
                idleFailureCount++;
                if (idleFailureCount > com.fsck.k9.mail.store.imap.ImapFolderPusher.IDLE_FAILURE_COUNT_LIMIT) {
                    timber.log.Timber.e("Disabling pusher for %s after %d consecutive errors", getLogId(), idleFailureCount);
                    pushReceiver.pushError(((("Push disabled for " + getName()) + " after ") + idleFailureCount) + " consecutive errors", e);
                    stop = true;
                }
            }
        }
    } 
    pushReceiver.setPushActive(getName(), false);
    try {
        if (com.fsck.k9.mail.K9MailLib.isDebug()) {
            timber.log.Timber.i("Pusher for %s is exiting", getLogId());
        }
        close();
    } catch (java.lang.Exception me) {
        timber.log.Timber.e(me, "Got exception while closing for %s", getLogId());
    } finally {
        wakeLock.release();
    }
}

